INSERT INTO `essays` VALUES (1,'美文摘抄','你的梦想，是复制别人的么？','<p><span style=\"font-size:20px\">&nbsp; &nbsp; 从小我们就变要求一模一样。服装一样，发型一样，就连人生的梦想也一模一样。考个像样的学校，找个像样的工作，租个像样的房子，过个像样的人生。曾经有着自己的梦想心跳很执着，曾经有着自己喜欢的东西就算没有人明白也没关系。终于有一天，你听最流行的音乐，看最卖座的电影，去最热门的电影，读最畅销的图书，什么时候起，是谁把我变成现在的我。</span></p>\r\n\r\n<p><span style=\"font-size:20px\"><img alt=\"你的梦想，是复制别人的么？\" src=\"http://www.szwj72.cn/Article/UploadFiles/201310/2013102109382846.jpg\" style=\"border:1px solid rgb(204, 204, 204); display:none; height:274px; max-height:400px; max-width:600px; padding:2px; vertical-align:middle; width:500px\" /></span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 老妈说，总有一天你的棱角会被世界磨平，你会拔掉身上的刺，你会学着对讨厌的人微笑，你会变成一个不动声色的人。总是觉得自己还没有准备好，就已经长大了，大人的世界蛮累的，很难懂，有那么多字典里无法解释的字眼，有那么多努力做好了也不会被所有人喜欢的事情。慢慢地，对那些伤害过我我伤害过的人习惯沉默，不去辩解不去反驳。有一天朋友指着你的痛处哈哈大笑，你却只能赔笑，怕被他们说开不起玩笑。明明最难过的是你，最先道歉的也是你。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 大学前好像有很多的梦想，总觉得有一天它们都会实现，身边有一群谈天说地一起傻逼的朋友，总觉得他们会一直陪在身边一起向着梦想前进。后来就把梦想弄丢了，那些朋友也找不到了，好像少了些什么，好像人一长大就会把那些丢了。开始想得越来越多反而不能义无反顾，也不会因为单纯的喜欢而跟那个人在一起，更不会再说那些，即使全世界要我们分开我们也不会分开，之类的话了。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 甚至不明白自己，到底真的相信我爱你这句话，还是只是想要，有个人对你说，我爱你，这样的话，而内心深处却并不一定是真的相信它。终于开始想，成长是不是人必经的溃烂，是不是收敛一点循规蹈矩一点，生活就会比较好过。是不是即使两个人相爱也是会分开的。是不是青春这个东西就这么没有了，是不是成长是这个世界上最痛苦最郁闷的事情。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 谁不曾想要自己的青春牛逼闪闪，谁不曾想要经历一些特别的事情去一些特别的地方，谁不曾想要轰轰烈烈度过那几年，谁不曾有着我们各自的梦想，开一个咖啡店，做一个背包客，开一家可以自己布置的书店，去山区支教，成为一个superstar，写一本书，或者做自己心里想要做的事情，可是为什么到最后我们变得一模一样，慢慢地梦想，就变成了，要赚很多很多的钱，要赚更多更多的钱，要住个不错的房子买个好看的手机有个漂亮带的出去的女朋友，过个像样的人生。如果梦想都一样，那还是梦想么。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 绝大多数人，也只是这样，没有遇到什么贵人，没有那么出众的天分，可是这也是世界的一部分，而这个世界上总有着那么一些人，在向前走着。也许有人说你梦想太大不切实际，又有人说你梦想太小胸无大志，有人又对你的梦想不屑一顾，那就不要去解释，没有必要，如果你在乎他总是不在乎，你梦想的东西他总是不屑一顾，那就不要去管那些人。因为他们不明白，也许那些你想要的东西在他们眼里不值一提，在你心里却是最珍贵也是最重要的东西，因为他们不知道，一个人的梦想也许不值钱，但是一个人的努力很值钱。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 如果你哭，你只能一个人哭，没有人在意你的懦弱，只有慢慢选择坚强。如果你笑，全世界都会陪着你笑，你给世界一缕阳光，世界还你一个春天。很多时候，我们都是在寂寞中行走，在孤独中思考，不要期望他人解读你的心灵，认同你的思想，要知道，你只是行走在世界的路上，而世界却给了你全部天空。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 所以为什么不勇敢地做自己一次看看。做你想要做的事情，因为能找到自己真正想要的事情就已经很难得了。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 我们的生命是有限的，青春更加的短暂，不要去过别人的生活，因为你是你。我们不能选择何时降临在这个世界上，我们不能选择我们的父母是谁，我们也不能选择自己会出生在什么地方，出生在什么国家，会在什么样的一个环境里成长。但是我们可以选择成为一个怎么样的人，过一个怎么样的人生，我们可以决定什么才是生命中最重要的东西。也许这个世界，你身边的人不会在乎你的选择你的决定，但是那却是我们自己的决定，最后我们就会变成那样的人。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 世界很操蛋，没有人否认这一点，但是其实这个世界也没有你想象的那么坏，因为我们都是这个世界的一部分，所以这是世界上还有那么一部分人，很大一部分人，在向着梦想走着，去相信这个世界的美好去相信未来相信爱情，即使最后一无所有，一事无成，至少不会遗憾，就够了。</span></p>\r\n\r\n<p><span style=\"font-size:20px\">&nbsp;&nbsp;&nbsp; 我们的生活就是在不断地出发中重生的，然后再遇到，最好的自己。</span></p>\r\n','2013-10-20 19:10:20','2013-10-20 19:10:20'),(2,'','淡定','<p>&ldquo;死生相阔，与子相悦，执子之手，与子携老。&rdquo;这是对爱情的淡定。</p>\r\n\r\n<p>&ldquo;我能想到最浪漫的事，就是和你慢慢变老。收藏起点点滴滴的心事，留到以后和你慢慢聊。&rdquo;这是对婚姻的淡定。</p>\r\n\r\n<p>&ldquo;我是一只修行千年的狐，千年修行，千年孤独。夜深人静时，可有人听见我在哭；灯火阑珊处，可有人看见我跳舞？......我爱你时，你正一贫如洗寒窗苦读；离开你是，你正金榜题名洞房花烛。能不能为你再跳一支舞？我是你千百年前放生的白狐。&rdquo;这是对失恋后的淡定。</p>\r\n\r\n<p>&ldquo;春有百花秋有月，夏有凉风冬有雪，若无心事挂心头，便是人间好时节。&rdquo;这是对世事的淡定。</p>\r\n','2013-10-28 04:13:33','2013-10-28 04:13:48');
/*!40000 ALTER TABLE `essays` ENABLE KEYS */;
UNLOCK TABLES;

