INSERT INTO `jokes` VALUES (1,'成功','她：“因为别人都不同情你，我才做你的妻子。”他：“你总算成功了。现在每个人都因此同情我。”','2013-10-28 20:10:37','2013-10-28 20:10:37'),(2,'结婚以后','女：“为什么从前你对我百依百顺，可结婚才三天，你就跟我吵了两天的架？”男：“因为我的忍耐是有限度的。”','2013-10-28 20:10:37','2013-10-28 20:10:37'),(3,'我们的','燕尔新婚，新娘对新郎说：“今后咱们不兴说‘我的’了，要说‘我们的’。”新郎去洗澡，良久不出，新娘问：“你在干什么哪？”“亲爱的，我在刮我们的胡子呢。”','2013-10-28 20:10:37','2013-10-28 20:10:37'),(4,'阎王之母','有一个男人，当他妻子临死时，他很悲伤地问她道：“妻呀！你死了之后，要使我当光棍了。现在趁你未绝气之前，先问你一句话：你死后，叫谁来做我的续弦夫人呢？你平日心中有否这个女人呢？”他妻子听了，虽在临终的时候，也挣扎起整个身体，怒气冲冲地骂道：“你这无情的男子，我尚未气绝，你就想续娶。像你这种忘恩负义的男子，谁个女人肯嫁你？你的后妻，一定是阎王的母亲无疑。”丈夫听了，摇摇头、说：“这样不可！一误不可再误。我已娶了阎王的女儿于先，难道还要娶阎王的母亲于后吗？”','2013-10-28 20:10:38','2013-10-28 20:10:38'),(5,'杞人忧天','妻子患了重病，医生宣告回天乏术。妻子即对丈夫说：“我现在希望你能够发誓。”“发什么誓。”“如果你再婚，不准把我的衣服给你的新妻子穿。”丈夫恍然大悟道：“这个我可以发誓。说实话，你根本不必操心，因为我再也不想找像你这样胖的太太了。”','2013-10-28 20:10:38','2013-10-28 20:10:38'),(6,'理由充分','法官：“离婚理由是什么？”新娘：“他打呼噜。”法官：“结婚多长时间了？”新娘：“三天。”法官：“离婚理由充分，结婚三天还不是打呼噜的时候。”','2013-10-28 20:10:38','2013-10-28 20:10:38'),(7,'报复','一位弥留之际的男人向妻子立下遗嘱：“我死后，但愿你能嫁给我们的邻居埃德先生。”\n妻子不解，于是他又解释说：“两年前，这混蛋卖给我的奶牛根本挤不出奶，我现在也要让他尝尝受骗的滋味。”','2013-10-28 20:10:39','2013-10-28 20:10:39'),(8,'聪明丈夫','某夫妇当街而过，一只鸽子飞过天空，一泡鸽粪不偏不倚正巧落在太太肩上，太太急了，忙叫丈夫拿纸。丈夫抬头，见鸽子不讲卫生，到处拉屎，却不知妻子叫他拿纸干嘛，说：“叫我有啥办法，追上前去给它擦屁股呀！ ”','2013-10-28 20:10:39','2013-10-28 20:10:39'),(9,'一枪双刁','有两个人去打高尔夫，休息中一位问另一位：“您是干什么的？”“我是为律师，您呢？”“实不相瞒，我是个杀手，不信你看我的包里还装着枪和望远镜。”这时律师拿起望远镜随便的看，突然看见自己家的凉台上，自己的妻子光着身子，有一位男人正在抚摩着他的妻子。他气急败坏的对杀手说：“赶快给我把这两个狗男女杀了。”杀手说：“行！我的一颗子弹是5000美金，两颗一共10000美金可以吗？”律师说：“没问题，快给我杀吧！ ”杀手又说：“看在我们很有缘得份上，我可以让你选择打他们的哪个部位？”律师说：“那个男人就打他的哪个地方吧！','2013-10-28 20:10:40','2013-10-28 20:10:40'),(10,'迷你','一天晚上妻子迫不及待的拥到丈夫怀里：“亲爱的，我想要………”丈夫手里拿着报纸，瞟都不瞟妻子一眼。于是，妻子恼羞成怒。\n第二天，丈夫又在看报纸，她穿着一身红色的性感泳装，在丈夫面前走来走去，丈夫还是不瞧她一眼。\n第三天，她又换上了一套蓝色的泳装，丈夫还是连头也不抬。\n到了第四天，妻子干脆什么也不穿，站在丈夫面前。这时，丈夫终于抬起了头，说：“前天，你穿了一身红色的泳装，真的很美，很性感，昨天你穿了一身蓝色泳装，也很美，怎么今天这身透明的泳装这么皱啊，该熨一下了………”','2013-10-28 20:10:40','2013-10-28 20:10:40'),(11,'你也属于我','夫妻吵架互不相让，最后丈夫勃然大怒说：“你快滚！把所有属于你的东西都带走！ ”妻子流着泪收拾好自己的行李，又把一只大麻袋往丈夫身边一扔说：“你钻进去！ ”丈夫吃了一惊，急问：“你要于什么？”“你也是属于我的，快钻进去！ ”妻子向丈夫吼道。','2013-10-28 20:10:40','2013-10-28 20:10:40'),(12,'死也不和你过','两口子关系不好，丈夫常常想着休妻另娶。老婆便威吓他说：“有朝一日你要是敢变了心，我非买点药毒死你不可。”男的说：“你下毒之前千万告诉我，我提前写好遗嘱，求官府别判你死罪。”妻子十分高兴：“到底是一日夫妻百日恩，难得你对我有那么点味儿。”男人说：“不是，我最怕官府杀了你，要是你死了，你的魂追到阴间，我不又得跟你过了吗？”','2013-10-28 20:10:41','2013-10-28 20:10:41'),(13,'事故与灾难','一位夫人问她的丈夫：“亲爱的，你能告诉我‘事故’与‘灾难’这两个词之间有什么区别吗？”“这很简单。”丈夫认真地回答说，“譬如你失足落水，这就叫‘事故’；如果人家又把你当鱼钓上来，这就是‘灾难’了。”','2013-10-28 20:10:41','2013-10-28 20:10:41'),(14,'吵架的结果','夫妻吵架了。当丈夫下班回到家里，他发现妻子不在家。只在桌上留了一个条子，上面写道：“午饭在《烹调大全》第215页；晚饭在317页。”','2013-10-28 20:10:41','2013-10-28 20:10:41'),(15,'绝招','大哥弄了一支甚重的自动步枪在家里，每逢大嫂发脾气，大哥总是二话不说，到旁边擦步枪去了。大嫂便吓得面容失色，一场内战还没开始，就结束了。我忍不住问大哥：“大嫂怕你杀她？”大哥很得意他说：“哪里，她是怕我自杀。”','2013-10-28 20:10:42','2013-10-28 20:10:42'),(16,'保险之险','太太不懂保险的道理，认为缴保险费是浪费，先生连忙解释说：“保险是为了你和孩子，万一我死了；你们也有个保障呀！ ”太太反驳说：“要是你不死呢？”','2013-10-28 20:10:42','2013-10-28 20:10:42'),(17,'补不足','妻：“我晓得，你与我结婚，是因为我有钱。”夫：“不是，是因为我没有钱。”','2013-10-28 20:10:42','2013-10-28 20:10:42'),(18,'未婚妻的定义','丈夫对妻子说：“杰克要是再问我们什么是‘未婚妻’时，我们该怎么解释呢？”“那就告诉他，”妻子说，“‘未婚妻’是指一个女人，在结婚后她所得到的一切，她还没有得到。”','2013-10-28 20:10:43','2013-10-28 20:10:43'),(19,'如此作品','妻子：“结婚半年多了，怎不见你搞文学创作？”丈夫：“我哪有那个天才呀！ ”妻子：“结婚前，你在‘征婚启事’上不是写了‘在省晚报上发表过作品吗？”丈夫：“我指的就是那份‘征婚启事’。”','2013-10-28 20:10:43','2013-10-28 20:10:43'),(20,'情有所钟','我祖父身高1. 60米，而健硕的祖母却高达1．80米。我小时候祖父已去世；有一次我跟祖母一起翻阅旧日的照片，突然想到他们两个站在一起一定很惹人注目。“祖母，”我问她，“你怎么会爱上一个比你矮的男人呢？”她转过脸来对我说：“孩子，我们是坐着谈恋爱的，等我站起身来，已经太晚了。”','2013-10-28 20:10:43','2013-10-28 20:10:43'),(21,'另有企图','夫妻二人吃饭时，妻说：“你现在怎么老是挑鱼身上的好肉吃？记得我们谈恋爱时，你最爱吃鱼头鱼尾……”“情况不同了嘛！ ”丈夫说，“现在我的目标是吃鱼，当时我的目标是钓鱼。”','2013-10-28 20:10:44','2013-10-28 20:10:44'),(22,'醉后','雄蟹向雌蟹求婚。雌蟹注意到雄蟹走路时是直行而非横行的。心里想：“这位先生真与众不同，我可不能让他跑掉。”于是他们当下就结婚了。第二天她注意到她的新婚丈夫和别的螃蟹一样，也在横行，就问道：“昨天你不是直行的吗？”“亲爱的，”她丈夫回答，“我可不能天天都喝得那么醉。”','2013-10-28 20:10:44','2013-10-28 20:10:44'),(23,'离婚','有一夭，两口子吵架，妻子闹着要同丈夫离婚。他们去法院的路上，要经过一条不大的河，到了河边，丈夫很快脱掉鞋子跳入水中。妻子站在岸边，瞧着冰冷的水，正愁着怎么过去。丈夫回过头来温和他说：“我背你过去吧！ ”丈夫背着妻子过了河。他们没走多远，妻子说：“算了，咱们回去吧！ ”丈夫诧异地问：“为什么？”妻子不好意思地低着头说：“离婚回来，准背我过河呢？”','2013-10-28 20:10:45','2013-10-28 20:10:45'),(24,'如实回答','妻子对丈夫表示不满地说：“啊，上帝呀！当初答应嫁给你的时候，我这脑袋瓜到哪里去了呢？”“在我的肩头上。”丈夫立即回答说。','2013-10-28 20:10:45','2013-10-28 20:10:45'),(25,'巧 合','要过圣诞节了。一对新婚夫妇完全不懂繁琐的节日仪式，于是丈夫叫妻子去愉看邻居铁匠家是怎么做的。妻走近窗口，看见铁匠正在用煤铲打老婆呢！妻子回家后，丈夫问她看见了什么，她死也不讲。最后丈夫气极了，拿起煤铲打她，她哭道：“既然你全知道，还让我去看什么？”','2013-10-28 20:10:46','2013-10-28 20:10:46'),(26,'不必当真','在一个盛大社交宴会上。主席收到一张字条：“假如格普塔先生在场的话，请马上回家。”一男士马上准备起身回家。“好了，不必了！ ”一位女士在大厅后面说道，“我只是想了解一下我丈夫是不是真的在这儿。”','2013-10-28 20:10:46','2013-10-28 20:10:46'),(27,'当天有效','“你是用什么办法把丈夫整夜不归的习惯改过来的？”“有一天晚上，他很晚才回来，于是我很快喊道：“‘是约翰吗？’而我丈夫的名字叫杰克。”','2013-10-28 20:10:46','2013-10-28 20:10:46'),(28,'对不起','丈夫又是一夜未归，妻子再也无法容忍了。一清早，丈夫推门进来，妻子用门后一根早已准备好的木棍将他打昏过去。待他一小时后醒来时，妻子抱歉他说：“亲爱的，对不起，我忘了你上夜班。”','2013-10-28 20:10:47','2013-10-28 20:10:47'),(29,'不必担心','一对夫妇坐夜车到外地访友。先生打算坐普通车，随便凑合度过一夜，可省下些费用。可太太却撒娇地说：“亲爱的，我希望能有一张卧铺，舒舒服服睡一夜。不然，在硬铺座我会睡不着的。”先生便应允着去买票了，但回来时却举着两张普通票，得意地对太太说：“仔细想了又想，还是普通车票便宜。”太太哭丧着脸说：“可我要失眠的呀！ ”“不要紧，我另外还买了两粒安眠药。”先生安慰她说。','2013-10-28 20:10:47','2013-10-28 20:10:47'),(30,'菩萨也会烦','新加坡某工程师的太太是虔诚的佛教徒，每天早晚须念千遍观音菩萨。丈夫对此很有看法，便打算想法改变太太的思想。某日，丈夫叫他太太，太太回了话，但他却毫不理会，又接着大叫了两句，如此一来，气坏了正在念经的太太，她气呼呼地说：“你穷叫什么？我又没聋！ ”丈夫回答：“我才叫你三句，你就生气；你每天叫观音菩萨千遍，不知你想过它的烦恼没有？”','2013-10-28 20:10:48','2013-10-28 20:10:48'),(31,'共同点','有人问一位妇女：“在你与丈夫20多年的共同生活中，你觉得你们存哪些共同点？”妇女考虑了很久以后答道：“我们唯一的共同点就是在同年同月同日结婚。”','2013-10-28 20:10:48','2013-10-28 20:10:48'),(32,'美容之后','妻子在美容院里接受了最新化妆术，嘴唇一片鲜红，眼睛用眼线、眼影、睫毛膏抹得非常鲜艳。她觉得自己变得很漂亮，急急忙忙地赶回家中，想让丈夫看了吃惊。她回到家里，愁眉苦脸的丈夫见了她那副模样立刻高兴起来：“咱们的儿子太淘气了，你去肯定会把他吓唬祝”','2013-10-28 20:10:49','2013-10-28 20:10:49'),(33,'夫妻小趣','妻子：“婚前你不是叫我天使吗？”丈夫：“对。”妻子：“为什么现在你不这佯叫我了呢？”丈夫：“呵，亲爱的，你应该高兴，现在我头脑正常多了。”妻子（在船上）：“如果这条船在沉下去，你首先救我还是救我们的孩子。”丈夫：“先救我自己。”妻子：“昨晚我做了一个美梦，梦见你答应给我200块钱买衣服。亲爱的，你会成全我的美梦吧？”丈夫：“那当然。说来巧，昨晚我梦见自己把200块钱给了你哩！ ”','2013-10-28 20:10:49','2013-10-28 20:10:49'),(34,'打招呼','妻子问丈夫：“当我快淹死的那阵，你看见那个前去救我的男人了吗？”“是的，他先到我这里打过招呼。”','2013-10-28 20:10:50','2013-10-28 20:10:50'),(35,'明智之举','有个妇人，按预约去看大夫，见了医疗报告单，弄得心都凉了，匆匆回到家。丈夫下班回家，一进屋，她就对他说：“亲爱的，大夫说我只能再活12个小时了。所以我决定，咱们应该上床，亲亲热热地过上一个通宵。你看怎么样？”“噢，这对你倒挺合适的。”丈夫回答说，“早上你就不必起床了！ ”','2013-10-28 20:10:50','2013-10-28 20:10:50'),(36,'自 白','产房里，即将临产的妻子对丈夫说：“我要告诉你，我的双眼皮是割的，鼻子是隆起来的，下巴是做的，所以娃娃生下来不像我的话，你不要吃惊。”丈夫安慰她说：“我早知道，不要紧。我也告诉你：我的右眼是假的，牙齿是装的，左腿是假肢！ ”','2013-10-28 20:10:51','2013-10-28 20:10:51'),(38,'本钱小了店面大了','女生不小心摸到男生的“那个”，於是就不好意思的问：“这是什么呀？”那男的回答：“本钱呀！ ”於是他们又接著继续温存。那男的不小心摸到女的“那个”，於是就不好意思的问：“这是什么呢？”那女的回答：“店面呀！ ”那男的就很高兴的说：“太好了！你有店面，我有本钱，我们一起来做生意吧！！ ”於是乎他们早也干晚也干，一天三餐，外加消夜及点心。最後那男的终於受不了而抗议说：“这太不公平了！我的本钱越做越小，而你的店面却越开越大！ ”','2013-10-28 20:10:51','2013-10-28 20:10:51'),(39,'空姐','从前有一只老鼠他很想找一个老婆，可是总是找不到。终于有一天他高兴的对他的朋友讲：“我有老婆了。呵呵！ ”朋友说：“你怎么不把弟妹领来让我们看看。”他说：“好吧明天。”于是第二天他带来了他夫人。大家看后（狂倒！！）怎么是只蝙蝠！“呵呵！这你们就不懂了。我老婆好赖也是个空姐呀！ ”再倒！！！！','2013-10-28 20:10:51','2013-10-28 20:10:51'),(40,'一毛钱的爱','“你有多爱我？”“一毛钱之多。”“只有这么一点么？”“一毛钱不就是‘十分’吗？”','2013-10-28 20:10:52','2013-10-28 20:10:52'),(41,'惊喜','一位太太突发奇想，想让丈夫有个意外惊喜。於是戴上假发，换上一套全新的衣服，并化了一个与平日不同的妆。然后到先生的办公室，卖弄风骚的说：“嗨！帅哥，你想不想和我………”他先生看了她一眼，立刻打断她的话，说：“不！我什么也不想，我一看到你就联想到我的老婆。”','2013-10-28 20:10:52','2013-10-28 20:10:52'),(42,'避孕','有一对夫妻，刚刚结婚不久，还不想要孩子，但不懂怎样避孕，就向医生求助。医生给了他们避孕套。夫妻高高兴兴回家了。过了几个月，妻子怀孕了。丈夫很生气就找到了医生大闹一顿。医生很纳闷，问：“你是怎么用的？”他说：“我一顿给我妻子吃两个呢！ ”','2013-10-28 20:10:53','2013-10-28 20:10:53'),(43,'妻子的埋怨','一对结婚四十年的老夫妻在谈话。妻子埋怨说：“你没有以前对我好了，以前你总是紧挨着我坐。”丈夫答：“这好办。”随即便移坐到她的身旁。“可过去你总是紧搂着我。”“这样好吗？”他搂住了妻子的脖子。“你还记得以前怎样吻我的脖颈，咬我的耳朵吗？”他忙跳起身，走出房门。妻子忙问：“你去哪儿？”丈夫答：“我得去取我的假牙。”','2013-10-28 20:10:53','2013-10-28 20:10:53'),(44,'太太画像','一位太太想画肖像，丈夫给她找来了最好的画家。当她坐下来画像时，提出了一个要求，希望给她画上项链、耳环、头饰等物，而事实上她并不戴这些金银首饰。画家同意了，但问道：“干吗要这样呢？”太太答道：“这是为了万一，你知道，我也许比我的丈夫死的早。那时他会马上再娶的，让他的新太太去找这些宝贝好了！ ”','2013-10-28 20:10:54','2013-10-28 20:10:54'),(45,'山东丈夫北京妻','一对小夫妻新婚之夜，女的对男的说：“我想要。”男的说：“俺给你。”过了一会儿，女的又说：“我还想要。”男的不悦：“俺再给你。”次日，女的说：“俺俺还想想要。”男的怒曰：“妈的，再要、再要都成了尿了。”','2013-10-28 20:10:54','2013-10-28 20:10:54'),(46,'做客','张先生和侯先生是好朋友。一日，张先生到侯先生家做客，侯先生不在。他的妻子对张先生说：“您贵姓。”“我姓张。”“是弓长张，还是立早章？”“弓长张。”“您用膳了吗？”“还没有。”“那我给您准备膳食。”张先生回家后对自己的妻子把侯先生的妻子大大夸赞了一番。张妻很是不服。某日，侯先生到张先生家拜访。张先生也不在，张妻问侯先生“您贵姓？”“免贵，姓候。”“您是公猴，还是母猴？”“公---猴。”侯先生一愣。“您骟了吗？”“还---没。”“那我进去给您骟了。”','2013-10-28 20:10:54','2013-10-28 20:10:54'),(47,'称赞过早','妻子：“我想给小狗起个名字叫‘拜伦’，母亲说这样侮辱了这位诗人；后来我想把你的名字改给它，母亲又说不好。”丈夫：“你的母亲真好。”妻子：“她说这样会侮辱了小狗。”','2013-10-28 20:10:55','2013-10-28 20:10:55'),(48,'打猎归来','打猎归来的丈夫在车站给家里打电话。“喂，是玛丽吗？你快来车站接我吧！ ”“收获怎么样？亲爱的。”“还可以，从现在起，至少一个月内我们不再买肉了。”“是打死了一只鹿？”“不，是工资全部花光了，现在我连坐车回家的车票钱都没有了……”','2013-10-28 20:10:55','2013-10-28 20:10:55'),(49,'离酒远点','妻：“你怎么用吸管喝酒呢？”夫：“是的！因为医生要我离酒远点儿。”','2013-10-28 20:10:55','2013-10-28 20:10:55'),(51,'当选','政治家在大选后对妻子说：“祝贺我吧，亲爱的，我当选了。”“你不是骗人吧？”“不，亲爱的，现在已经用不着骗人了！ ”','2013-10-28 20:10:56','2013-10-28 20:10:56'),(52,'合身的衣服','丈夫：“我给你买的那件衣服还合身吗？”妻子：“是的，而且我们的四个孩子穿也都很合身。”丈夫：“不错吧？我早就已经向你说过是件好衣服嘛！ ”妻子：“那倒不见得，每下一次水就缩一截，咱们只有四个孩子，现在都不敢再洗了。”','2013-10-28 20:10:56','2013-10-28 20:10:56'),(53,'虚 惊','妻子抱怨晚上太冷，买了一床电热毯，但丈夫伯不安全，经过半天时间解释，他才肯睡这床电热毯。在睡前，妻子在烤箱里放了一块火腿，用低温烤着，以便早上起来不必赶做早点。到午夜后，一阵肉香飘人卧室，丈夫从梦中惊醒，跳起来，摇醒妻子说：“亲爱的，快醒来，我们被烤熟了。”','2013-10-28 20:10:57','2013-10-28 20:10:57'),(54,'拳 击','夫妻俩常常发生争论，而每次争论的结果，总是妻子赢。每当争论到最激烈的时刻，丈夫就会退出争论而走到地下室去。在那里，保留着一个练习拳击用的吊袋。每次走到那里，他总要对准了吊袋猛击它15分钟，把怒气发泄出去，然后就觉得心情舒畅了。有一天，形势变了，争论的结果，丈夫赢了。这位丈夫感觉到他那位妻子快要大发脾气了，就建议去试一试他的那个吊袋。妻子接受了他的意见，来到地下室，一连十几分钟的猛击猛捶之后，她回到了楼上，乐得嘴都合不拢了。丈夫问她：“怎么这样高兴？”她回答说：“我为什么不应该高兴？我在第三轮就把你打得昏倒','2013-10-28 20:10:57','2013-10-28 20:10:57'),(55,'重温旧梦','加利米安老爹和老伴谈他们的青年时代，对遥远过去的回忆使他们激动不已，于是他们决定像年轻时做的那样，定了个到河边约会的日子。届时，老爹采集了鲜花，来到了河边等待，而老太大却觉得叫人看见太难为情。加利米安老爹空等一场，只有回家，他看到了老伴盖着羊皮袄躺在床上。老爹嚷起来了：“你怎么敢失约呢？”老太太把脸埋在枕头里，羞怯地说：“妈妈不让我去。”','2013-10-28 20:10:57','2013-10-28 20:10:57'),(56,'解释','凌晨，我和丈夫被一阵电话铃声吵醒，我嘟哝着去听电话。“谁呀？”紧接着一个男人悲哀急促的声音使我吃了一惊，“菲丽丝，我的心肝，别挂电话，请听我解释……”“但是……”我想插进去说。“我答应你我决不再那样干了，在这个世界上你对我就是一切！ ”“可是……”我急于解释。“不！听我说，没有你我会死的！ ”这时候，站在我身边的丈夫开始大笑起来。“你在外面有男人了。是吗？菲丽丝？”“我不是菲丽丝！ ”我大喊道，“你打错电话了！ ”“你为什么不早说？”那个男人叫道，“现在我又不得不再把这些话去重复一遍了！ ”停了一下，他平','2013-10-28 20:10:58','2013-10-28 20:10:58'),(57,'出乎意料','布莱尔上校回到家中，发现妻子安娜正和情人西蒙在卧室里谈笑。他大怒，指着西蒙骂道：“混蛋，你给我滚出去。”西蒙也不示弱：“滚出去的应该是你，安娜爱的是我。”布莱尔仍大骂不止，西蒙提出用决斗的方式决定谁拥有安娜。他们来到另一个房间，西蒙说：“咱们朝空中放空枪，然后两个人躺倒在地上装死，看安娜进来后先到谁身边，她先到谁身边就说明她爱谁，谁就拥有她。”两声枪响之后，安娜跑进来了，发现他俩都倒在地上，顿时欢呼着跑到大衣柜前喊道：“亲爱的，出来吧！他们两个都死了。”','2013-10-28 20:10:58','2013-10-28 20:10:58'),(58,'所谓圣人','一位老翁在客人面前介绍他三个儿子。他说：“大儿子是[上等人]，因为他怕老婆；二儿子是[中等人]，因为他敬老婆；三儿子是[下等人]，因为他打老婆。”客人忍不住问：“老翁是哪种人？”老翁说他是圣人，因为上中下全等来。','2013-10-28 20:10:59','2013-10-28 20:10:59'),(59,'贺年片','春节快到了，小王要给未婚妻挑一张贺年片。“这张比较适合，你看多漂亮！上面写道：向我唯一的心上人致以最美好的祝愿！ ”漂亮的女售货员给他出主意。“好极了！你给我十张……”','2013-10-28 20:10:59','2013-10-28 20:10:59'),(60,'借你的一用………','一书生新婚之夜只顾自己读书，不于新娘行房事。新娘耐不住寂寞，便上前挑斗书生。书生却一本正经的说：“你我父辈乃甚世之交（只不过是好友罢了），我决不会于你做出这等苟且之事！！！ ”新娘又好气又好笑，只好自己躺在床上自慰。朦胧之中见自己夫君的一只手伸了过来，大喜之时急忙闭上双眼等待好事的发生。但过了半天也不见动静，睁开眼睛却发现书生依旧在看书。新娘奇怪的问：“你刚才………”书生赶紧为自己解释：“我用口水翻书看了半天，早已口干舌燥；见你这里水源丰富，于是借你的一用………”','2013-10-28 20:10:59','2013-10-28 20:10:59'),(61,'思妻心切','丈夫：“亲爱的，你这次出差，我想你都快要疯了。”妻子：“瞧你，我不过才走了四天。”丈夫：“可是，整整四天我都没有找到放钱抽屉的钥匙。”','2013-10-28 20:11:00','2013-10-28 20:11:00'),(62,'好 客','“你太大知道我要去你家吃晚饭吗？”“当然知道了，为了这件事她跟我吵了几乎半个小时。”','2013-10-28 20:11:01','2013-10-28 20:11:01'),(63,'难得机会','“我妻子和别人私奔了！ ”“什么时候？”“前天在我洗澡的时候。”“啊，她一定等了很久，才得到这次机会。”','2013-10-28 20:11:02','2013-10-28 20:11:02'),(64,'正确无误','一个人问他非常害怕老婆的朋友说：“圣经上说：丈夫是妻子的头，你的情形是这样吗？”那朋友的妻子抢着答道：“怎么不是？我只是他的喉舌而已。我负责开口说话，他负责点头。”丈夫在旁点头表示赞同。','2013-10-28 20:11:02','2013-10-28 20:11:02'),(65,'信以为真','丈夫一连好几个星期夜不能寐。妻子看到几篇如何松弛神经的文章，就决定在他身上试试。待他上床以后，妻子柔声说道：“你想象你正坐在最爱去的那湖边垂钓。日光暖洋洋的，微风轻抚。鱼线上的浮子正上下颤动，在水里一路一招。”他的两眼合上了。妻子刚以为已获成功，谁知他一下子直挺挺在床上坐起来。他说：“可我钓鱼是从不用浮子的。”','2013-10-28 20:11:03','2013-10-28 20:11:03'),(66,'哎呀，你为什么会陪我到天荒地老呢！','丈夫见妻子满面愁容就关切的问道：“哦！亲爱的你怎么了？”“我很忧愁。”妻子回答道。“为什么呢？”丈夫愈加惊讶。妻子回答：“我不知道你会陪我一起到什么时候？”丈夫温柔的看着妻子说道：“你放心吧！我会陪你到天荒地老。”“这正是我担心的事情。”妻子叹气道。','2013-10-28 20:11:03','2013-10-28 20:11:03'),(67,'受二茬罪','老婆总觉得婚后的生活不够浪漫，有时就对老公说：“我们再谈一次恋爱如何？”谁知老公忙不迭的摆手，说：“算了吧，那玩意儿，太累！好歹骗了个老婆到手，今后就可以安安稳稳地过日子了，我决不愿再回到万恶的旧社会！ ”','2013-10-28 20:11:04','2013-10-28 20:11:04'),(68,'好女子','张三的儿媳妇整天在家里闹得不可开交。 张三没办法，找到媒人李四说：“当初你给咱娃介绍对象的时候，口口声声说是一个好女子，谁知她竟是这样……” 李四忙解释说：“当初我只说她是个好女子，可没说她是好媳妇呀！ ”','2013-10-28 20:11:04','2013-10-28 20:11:04'),(69,'还是步行好','阿拉尔罕买了１０头驴子。当他骑在驴上数数时，发现只有九头。而当他下来步行时，所数的驴子正好是１０头。骑上去数，又是９头。跳下来数，又是１０头。反反复复十来次，阿拉尔罕总结道：“还是步行好！ ”','2013-10-28 20:11:05','2013-10-28 20:11:05'),(70,'桥高','两个人相互吹嘘自己国家的桥高。一个人说：“在我们国家的那座桥上，一个人如果想跳河自杀，他得10分钟后才能落水淹死。”“这算什么。”另一个说，“在我们国家的那座桥上，如果一个人想跳下去自杀，你猜他是怎么死的……他是在下落的过程中饿死的！ ”','2013-10-28 20:11:05','2013-10-28 20:11:05'),(71,'因人而异','西德有一个人，对于违犯交通规则的罚款制度发生兴趣，故意把车子停在不应停车的地方，他一共收到三张传票。他衣冠楚楚的拿了第一张传票去见法官，法官罚了他三个马克。第二次他穿著乞丐似的衣服拿第二传票去见法官，法官罚了他两个马克。他又叫他美丽的妻子，拿了第三张传票去见法官，结果，法官只罚了他一个马克。','2013-10-28 20:11:06','2013-10-28 20:11:06'),(72,'生意兴隆','拳击比赛当中一位选手的牙齿都被打掉了。看的人心都提着。唯有一位观众高兴得眉开眼笑，手舞足蹈。作在旁边的观众好奇的问：“先生，你是拳击教练吗？”“不，我是牙科医生。”','2013-10-28 20:11:06','2013-10-28 20:11:06'),(73,'还没到家','哈比有些醉了，开始和弹钢琴的那位性感的女郎调情。这时，他的妻子走了过来，对他说：“回家后别忘了提醒我为你青肿的眼睛准备些药膏。”“可我的眼睛并没有青肿啊?”哈比不解地问。“我们这不是还没到家吗?”妻子冷笑着说。','2013-10-28 20:11:07','2013-10-28 20:11:07'),(74,'一条新裤','郑县某人，叫妻子为他做条新裤。妻子问:“裤子做成什么样式?”他说: “像那条旧裤一样。”妻子做成新裤后，就将它弄得像旧裤一样破旧。','2013-10-28 20:11:07','2013-10-28 20:11:07'),(75,'妥协','一位先生对别人说：我太太和我意见不和。她想要一件毛皮大衣，而我想要一部新车。最后我们互相妥协了，买一件毛皮大衣，然后把它收到车库里。','2013-10-28 20:11:07','2013-10-28 20:11:07'),(76,'心不在焉','结婚35周年的那一天，夫妻俩在餐桌上一起吃早餐，丈夫说：“老伴，你可知道，你我坐在这两把椅子上已经整整35年了吗？”老伴放下手中的报纸对他说：“你是不是想与我换个位子？”','2013-10-28 20:11:08','2013-10-28 20:11:08'),(77,'有一对夫妇要离婚','有一对夫妇要离婚，可是他们有一个孩子，两个人都想要，所以就告到法院去了。太太说：孩子是我生的，我生孩子的时候你都旁边凉快。所以孩子应该是我的。法官想想就说：嗯！！你对，孩子是你的。丈夫想想这样不对，结果他突然想道就说：不对不对！！请问法官大人！！你有没有看过自动贩卖机！法官说：怎样！丈夫说：你投钱进去掉出来的饮料是你的，所以孩子是我的。法官想想就说：嗯！你对！孩子是你的。','2013-10-28 20:11:08','2013-10-28 20:11:08'),(78,'时髦理由','“你知道为什么近来男人们都喜欢留着夫人一样的长发？”“因为，假如你的情人或妻子在他们衣服上发现了长发，他会笑着说：‘这是我的头发／”','2013-10-28 20:11:08','2013-10-28 20:11:08'),(79,'水出高原','安鸿渐很滑稽，但就是怕妻子。一年，丈人死了，按当地风俗，安鸿渐要身着素服哭于门口的路边。妻子把他喊到灵帐中责骂道：“你哭的时候为什么没眼泪？” 安鸿渐说：“你见到没泪时，是已经被手帕擦干了。”妻子严肃地说：“明日一早出棺，一定要哭出眼泪来！ ”安鸿渐只得诺诺应命。但哭不出眼泪实在是无法，就在出棺前，用一种较宽的手巾把湿纸头夹在中间，扎在额头上，每次叩头，总用力撞地以挤出水来，还装着嚎陶大哭的样子。刚哭罢，妻子又把他喊入灵帐内，一看大惊，说：“别人眼泪都从眼中流出，你怎么会从额上流出的啊？” 安鸿渐答道：“','2013-10-28 20:11:09','2013-10-28 20:11:09'),(80,'说个好字','老婆：“亲爱的，这肉丝好不好吃？” 老公：“马马乎乎。” 老婆：“这鱼呢？” 老公：“将就。” 老婆：“那这豆腐呢？” 老公：“一般。” 老婆按捺不住吼道：“你就不能说个好字？” 正喝着汤的老公大叫道：“好烫！ ”','2013-10-28 20:11:09','2013-10-28 20:11:09'),(81,'出色的演员','一辆有两名乘客的汽车闯红灯，被警察叫祝“我非常遗憾，”司机很快明白过来，说，“但是，我是个医生，急着把这个病人送进精神病医院。”警察怀疑司机是欺骗他，但是乘客也是一个相当聪明的小伙子，他用天使般的目光瞅着这位维护秩序者，微微一笑，小声说：“吻我一下吧，我亲爱的。”警察马上痛痛快快地放了他们。','2013-10-28 20:11:09','2013-10-28 20:11:09'),(82,'地下舞厅','某日，老苏往地下室第五厅接洽公务，适其太太拨来电话找他，当时接电话的同仁说：“ 苏厅长刚刚到地下五厅去了。”苏太太听后大为气愤地喊道：“上班时间怎么可以去地下舞厅？”','2013-10-28 20:11:10','2013-10-28 20:11:10'),(83,'坚强点，亲爱的','有一个囚犯逃离了关了他１５年的监狱。他越狱后，他闯入了一间民宅，看到了一对年轻的夫妻躺在床上。 他把那位丈夫的赶下床，绑在椅子上，把太太绑在床上，他上了床，亲吻那太太的脖子，然后就进去了洗手间。当那逃犯在洗手间的时候，丈夫跟他的太太说：“听著，这个男的是囚犯，看看他的衣服就知道！他可能被关很久，而且很久没碰过女人了，假如他想要做爱，千万不要抵抗，也不要抱怨，就让他做他想做的事，让他满足就好。这个人非常的危险，假如让他生气的话，他可能会把我们杀了。坚强点，亲爱的，我爱你！ ”这时候他太太说：“我很高兴你这样','2013-10-28 20:11:11','2013-10-28 20:11:11'),(84,'补心肝','妻子在厨房做饭，忙得满头大汗。丈夫却坐在餐桌边悠闲他说：“讲到吃，我最有研究。譬如吃猪脑补头脑，吃猪脚补脚筋，吃……”这时，妻子端来一盘炒猪心，放在餐桌上，丈夫夹一块放进嘴里，边吃边问妻子：“你知道这猪肝、猪心补的是什么？”“是补那些没心肝的人。”妻子不耐烦地答道。','2013-10-28 20:11:11','2013-10-28 20:11:11'),(85,'不能糟踏','一个农家妇女，丈夫接她到城里来祝 她孩子得病，吃了药，病治好了。药还剩下一些，她悄悄地把药吃光，很快自己病倒了。丈夫发现她吃了孩子剩下的药，埋怨她，她说：“不能糟踏东西呀！ ”','2013-10-28 20:11:12','2013-10-28 20:11:12'),(86,'等下一班车吧','一个女售票员和她丈夫一起乘凉。过了一会儿，两个一起往家里走，女的先进门，顺手就把门关上了，丈夫在外面大吼：“开门，我还在外面呢！！ ”她妻子在里面叫道：“吵什么吵，等下一班车吧！！ ”','2013-10-28 20:11:12','2013-10-28 20:11:12'),(87,'什么关系','某一律师问一已婚男人：你跟你的性生活美满吗？答曰：很美满啊！律师：那你为何要和你太太离婚？？男人：我的性生活跟我太太有什么关系啊？－。','2013-10-28 20:11:12','2013-10-28 20:11:12'),(88,'方式不同','我妻子一生气就乱摔乱砸，把气往东西上撒。”“我妻子可爱惜东西，她有气就往我脸上撒。”','2013-10-28 20:11:13','2013-10-28 20:11:13'),(89,'上下带口罩','闹非典期间，某妇人紧张得很，几乎无时无地不戴着厚厚的口罩，引起了丈夫的不满。后妇人来了月事，虽用了卫生巾仍经常渗漏。丈夫戏噱道：“好嘛，现在连下面也戴起了口罩。只是下面还要经常流‘口水’。”','2013-10-28 20:11:13','2013-10-28 20:11:13'),(90,'毒药汤','从前有位老公公，他很喜欢喝汤。他只要一天不喝就全身不舒服，所以他天天叫他太太煮给他喝。结果有一天他太太死了。他也没汤可以喝了啊！所以他开始叫他媳妇煮。 可是不论他媳妇煮的再好。他总是把它丢在一旁说：“不是这个味道。这么难喝的汤你也煮的出来啊！ ”刚开始媳妇总是忍气吞声，心想只要煮出那味道就好。但日子一天一天的过去了，她依然煮不出来，而且也越来越不耐烦，终於她起了杀机。 她要杀了她公公，可是她不知道要怎样下手。她想啊想的，突然她在角落发现了一罐已生锈不堪的杀虫剂，她把杀虫剂喷到汤里。然后鼓起勇气的拿给她公公','2013-10-28 20:11:13','2013-10-28 20:11:13'),(91,'睡不着','晚上丈夫在床上翻来复去睡不着，妻儿问：“亲爱的你这是怎么了？”丈夫说：“我借了老王家的钱明天就到期了。可是还没钱还这可该怎么办埃”妻儿听说：“啊你就为这个？”说着就下床走到窗边打开窗子就大声叫：“老王、老王，我家亲爱的明天没有钱还给你！ ”说完后就关好窗子回到床上，笑嘻嘻的说：“亲爱的你就安心的睡吧，现在该轮到老王睡不着了。”','2013-10-28 20:11:14','2013-10-28 20:11:14'),(92,'丈夫消费税','某管夫严协会在没收丈夫钱财，仍控制不住丈夫风流的前提下，制订如下章程：丈夫每晚出去会朋友前，必须向妻子交税（既向妻子交“公粮”）然后就可以出去了，反正已没有“公粮”交了，任你再神勇，没有子弹的枪是不能上阵地的。','2013-10-28 20:11:15','2013-10-28 20:11:15'),(93,'洗衣服','有一对夫妻，他们每次要做爱前，就用洗衣服来暗示。这一天，他们吵架了，老公想做，但又不想直接跟他老婆说，就叫他的儿子转告。他儿子跑到他妈前说：“妈，爸爸说他的衣服脏了，想拿来洗。”妈对儿子说：“今天洗衣机坏了，不能用了。”但过了一段时间，她也想做，就叫他儿子转告，叫他爸爸把衣服拿来洗，儿子跑去对爸爸说完了后，爸爸就说：“你去跟你妈说，我已经用手洗过了。”','2013-10-28 20:11:15','2013-10-28 20:11:15'),(94,'各有所思','妻子：“你这个人太不近人情了，每次看见漂亮的女子，就忘了自己已经结过婚了。”丈夫：“恰恰相反！我每次看见漂亮的女人，心里最耿耿于怀的就是自己已经结了婚。”','2013-10-28 20:11:15','2013-10-28 20:11:15'),(95,'姐妹夸夫','三个姐妹在一起谈论起了各自的丈夫。老大说：“我的丈夫每次能干我两个小时。”老二说：“我的那位每次能干我四个小时呢。”老三脸红红的一直未支声，老大和老二问老三，老三羞答答的说：“八分钟。”老大和老二奇怪的问：“怎么这么短时间？”老三道：“光射精八分钟。”','2013-10-28 20:11:16','2013-10-28 20:11:16'),(96,'都没变','丈夫：“今天是我们的结婚纪念日，当时的一切就好像在眼前，你还和当年一样，一点没变。”妻子：“当然，10年来我就一直穿着这件衣服呀！ ” ','2013-10-28 20:11:16','2013-10-28 20:11:16'),(97,'上荧屏','电视台反复播映着“寻人启事”：“和子，你在哪里？看到电视后，赶快回家，你丈夫在焦急地等着你。”在播映过失踪者的照片后，电视播音员又继续说：“和子的丈夫，你一定很难过了，但你思考过没有，妻子为什么突然要离开你呢？……”正在看电视的丈夫默默地回答：“我怎么会知道呢？我的妻子总是想让她的照片通过电视到处传播，哪怕只是一刹那也好……我们只好想出这个办法。现在她如愿以偿了，她马上就会回到家里来！ ”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(98,'微不足道','丈夫躺在床上，他得了感冒。“亲爱的，如果我死了，你会因想念我而感到有点忧郁吗？”“那当然，亲爱的，因为你是知道的：任何微不足道的小事我都要哭一场的。”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(99,'找丈夫','一女人找到私家侦探社，要求帮助寻找丈夫。私家侦探问：“您丈夫的照片有吗？”女人说没有。“那么，您丈夫长什么模样？他有什么嗜好？个人能力如何……等等，我们需要线索。”女人道：“他长得很高，体形不肥不瘦，很有钱，业余爱好音乐，对我很体贴，性功能正常……”“我认识你丈夫，”一位刚刚进来的太太插嘴说，“他完全不是这个样子！ ”“别理她，”女人忙对侦探说，“要是你们帮我找到我所要求的丈夫，家里那个我就不要了！ ”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(100,'想要……','在法庭上，律师问：“夫人，离婚后您打算得到些什么？”“我想要孩子、房子、汽车和……一个真心爱我的丈夫。”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(101,'太晚了','妻子在临终的丈夫旁哭泣，丈夫安慰道：“别伤心了！也许不久你会再找到一位理想的伴侣！ ”妻子反而哭得更伤心他说：“谁会要我这老太婆呢？如果你10年前就这样的话……” ','2013-10-28 20:11:18','2013-10-28 20:11:18'),(102,'太太还没批准','艾登斯对轰轰烈烈的女权主义运动颇不以为然。有位朋友建议他写一本提倡男权主义的书，艾登斯说：“早就写好了。”“那为什么还不出版呢？”“太太还没批准呢。”艾登斯苦笑着说。','2013-10-28 20:29:46','2013-10-28 20:29:46'),(103,'两 倍','一个妇女沿着海边垂头丧气地走着，忽见沙中有个瓶子。拾起瓶子拔开瓶塞，唰地冒出了一大股浓烟。一个魔怪在浓烟中对她说：“你把我从牢狱中放出来了，为了报答你，准你实现三个心愿。不过你得当心，对于你许下的每一个心愿，你男人都会得到相当于你所得到的两倍。”“为什么呢？”女人问道，”那个无赖抛弃了我，投入了另一个女人的怀抱埃”“上帝就是这么安排的。”魔怪答道。妇女耸了耸肩，于是向魔怪提出要100万美元。电光一闪，在她的脚边出现了100万美元；而同一时刻，在另外一个地方，也就是在抛弃了她的丈夫的脚边突然出现了200万美','2013-10-28 20:29:46','2013-10-28 20:29:46'),(104,'想不到的帮凶','百万富翁的夫人突然接到一封恐吓信，说三天之内不送5万美元到指定地点，将暗杀她的丈夫。夫人迅速将一个信封送到那个地方，强盗打开信一看，没有钱，只有一张便条：“希望你们信守诺言，我以后会给你10万美元报酬。”','2013-10-28 20:29:46','2013-10-28 20:29:46'),(105,'谁是第二个丈夫','太太回家以后，高兴地对丈夫说：“我今天请人看过手相，他说我的第二个丈夫是个英竣学问又好、非常体贴人的人。”“哦？”丈夫连忙问道，“你跟我是第二次结婚吗？”','2013-10-28 20:29:47','2013-10-28 20:29:47'),(106,'不再惦记','达芙妮的丈夫年纪轻轻地就死了。葬礼之后，她的朋友们来看望她。“你真可怜，达芙妮，你每天晚上等待的人儿再也不会回来了 。” “噢，我已经习惯了。不过，我现在至少已经知道他是在哪里过夜了，再也不用老是惦记了。”','2013-10-28 20:29:47','2013-10-28 20:29:47'),(107,'另请高明','莉莎：“爸爸，这道算术题我不会算。你能告诉我吗？”爸爸：“你说说，是什么题？”莉莎：“有个人每月薪水300元，他太太每月却要花去320元，问……”爸爸：“别问我了，还是问你妈去吧，她是这方面的专家。”','2013-10-28 20:29:47','2013-10-28 20:29:47'),(108,'发 现','一位官员接连几个晚上参加会议，使他的妻子产生了怀疑和怨恨。一天早上，他回到家里，发现一张便条，上面写道：“前天你是在昨天早上回家的；昨天你是在今天早上回家的；因此，如果你今天是在明天早上回家的话，那你就会发现我已在昨天离开你了。”','2013-10-28 20:29:48','2013-10-28 20:29:48'),(109,'绝 望','看护妇甲：“505号病人，彻底绝望了。”看护妇乙：“呀，为什么？刚才他还握着我的手，谈了好久呢。”看扩妇甲：“正是这样，刚才被他夫人看见了。”','2013-10-28 20:29:48','2013-10-28 20:29:48'),(110,'一家之主','我们教堂按照殖民时期英国的风俗做了一次主日礼拜。牧师穿着长袍和灯笼裤，教徒则按性别分开：男人在左边，女人在右边。到捐款时，牧师宣布这也要按过去的方式办，他要求“一家之主”上前来把钱放在供坛上。男人们立刻站了起来，有趣的是许多人跨过走道去向他们的妻子要钱。','2013-10-28 20:29:48','2013-10-28 20:29:48'),(111,'像在家里一样','丈夫忍受不了凶悍泼辣妻子的折磨，逃出家门，投宿旅馆。旅馆经理为他打开一个房间，讨好说：“住在这里，你会感到像在自己家里一样。”这人一听此言，大声呼救：“天那，快给我换个房间吧！ ”','2013-10-28 20:29:49','2013-10-28 20:29:49'),(112,'流言蜚语','某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：“喂，安娜，你看到今天早报上的流言蜚语了吗，真可笑！他们说，你收拾行装出走了。你听见了吗、安娜、你在哪儿？安娜？啊！ ”','2013-10-28 20:29:49','2013-10-28 20:29:49'),(113,'偷情','一对夫妻在床上熟睡。大约是半夜时分。好像外面有什么动静，把妻子惊醒了。妻子有点迷迷糊糊，连忙把身边的丈夫推醒。并对丈夫说道：“ 快点起身，好像我丈夫回来了。”丈夫被妻子给推醒了，也是迷迷糊糊的，听到妻子的话后，边起身边说：“你怎么不早说，那我现在该往哪儿躲埃”','2013-10-28 20:29:49','2013-10-28 20:29:49'),(114,'夫妻之间','当我照例在下午5点下班回家时，发现妻子那天情绪不佳，其结果便是短兵相接和令人不快的态度，我的所作所为没有一样是对的。 到了晚上7点，事态还不见好转，于是我提议我走出去，假装刚到家，然后一切从新开始，妻子答应了。 我出门后，再一次进来说道：“亲爱的，我回来了！ ” “你刚才上哪儿去了？”她厉声问道，“已经7点了。”','2013-10-28 20:29:50','2013-10-28 20:29:50'),(115,'不会冲突','一位女士和一位足球教练结婚快40年了， 她深知球赛对丈夫来说总是头等重要的事。 有一天她特别沮丧，脱口而说： “弗郎克，你呀，宁可误了我的葬礼，也要去看球赛！ ” 丈夫非常心平气和，答道： “罗伯塔，到底是什么使你想到， 我会把你的葬礼安排在有球赛的日子呢？”','2013-10-28 20:29:50','2013-10-28 20:29:50'),(116,'妙 招','莫特·沙尔非常同情“足球寡妇”。有一次，一位妇女问他怎么才能将她丈夫的注意力从电视上转到她身上，他回答：“穿透明的衣服。” “要是这样也不奏效呢？”她问。 “那你在背上贴个号码！ ”沙尔回答。 ','2013-10-28 20:29:50','2013-10-28 20:29:50'),(117,'恩爱的夫妻','一对恩爱甚笃的夫妇正庆祝他们的金婚日。 看热闹的中年邻居问老生先说：「为什么你们可以维持五十年幸福美好的婚姻，打从我出生起，就未曾听过你们吵架的声音，难道你们之间从来没有任何的争执吗？」老先生说：「争执当然是有的，不过都不会扩大。我从蜜月旅行的时候就懂这个道理了...记得当时交通不便我们到大峡谷去度蜜月，一个人各雇了一匹驴子。她的驴子显然好吃懒做，走没有多久就赖在路边休息。我只听到我太太冷冷地说：『第一次。』驴子第二次想偷懒的时候，她又指着驴子说：『这是第二次。』当驴子第三次不肯走时候，她不慌不忙的掏出她','2013-10-28 20:29:51','2013-10-28 20:29:51'),(118,'饺子结婚','2个饺子结婚，当晚闹洞房。送走客人后，公饺子回屋猛然发现床上有个肉丸?子，而母?饺子却不见了。慌得他连忙叫到：“我的新娘子哪里去了？” 肉丸子嗔怪地说：“讨厌，人家脱了衣服你就不认识人家了？！ ”','2013-10-28 20:29:51','2013-10-28 20:29:51'),(119,'准时回家','一个典型的大男人娶了个典型的小美女，婚礼刚刚结束，大男人就立下了下面的规矩： “我想什么时候回家就什么时候回家，只要我想，不论是什么时候我想，你都不能为此为难我！ “每天晚上你必须为我准备好一顿丰盛的晚餐，除非我告诉你我不回来了。只要我想，我就可以和我的老朋友出去打猎、钓鱼、饮酒或打牌，你也不能为此刁难我！这就是我的规矩……你有什么意见吗？” 他的新娘很大度地说：“没有意见，你为我想得很周到。我只是提醒你记住一件事情……每天晚上七点准时做爱——不论你在还是不在！ ”','2013-10-28 20:29:51','2013-10-28 20:29:51'),(120,'化装舞会','化装舞会前，太太忽不适，便叫丈夫单身赴会。稍后，太太自觉好了点，便换上一套丈夫从未见过的时装，驱车也去参加舞会了。刚进门，太太便看见丈夫与其他女人打情骂俏，不禁妒火中烧，决定试探一下丈夫。她走到丈夫身旁，娇声媚气，投怀送抱。最后还引诱他到后花园去，尽情风流。到了午夜，当大家将要脱下面具时，太太才悄悄离去。而她丈夫直到凌晨三时才回来。 “舞会怎么样？”太太问。 “一点也不好玩。”丈夫答。 “你在那里究竟干了些什么？”太太再三追问。 “老实告诉你吧，”丈夫道，“我到那里时，见到几个朋友都没有带妻子，于是我们几','2013-10-28 20:29:52','2013-10-28 20:29:52'),(121,'停电','一对新婚夫妇去一个小岛度蜜月。在入住的时候老板对他们说:“这个岛电力有问题，估计一小时要停一次电！ ”于是这小夫妻决定每停一次电就做一次爱。3小时后，丈夫偷偷跑下楼来对老板说：“老板我多给你50元，你能不能2小时停一次电？”老板回答：“怎么不早说 你妻子多付了100元要我半小时停一次电！ ”','2013-10-28 20:29:52','2013-10-28 20:29:52'),(122,'巧答恋爱经过','婚礼晚会上，许多朋友让新郎介绍恋爱经过，新郎说：“本新郎姓张，新娘姓顾。我俩尚未认识对方时，我东‘张’西望，她‘顾’影自怜。后来我‘张’口结舌去找她，她左‘顾’右盼等着我。到认识久一点，我便明目‘张’胆，她也无所‘顾’忌。于是，我便请示她择日开‘张’，她也欣然惠‘顾’”。','2013-10-28 20:29:53','2013-10-28 20:29:53'),(123,'担心','妻子对丈夫说：「你每次出门，我都会非常担心。」「亲爱的，别担心，」丈夫安慰她道，「我会随时回来的。」「这正是我所担心的。」','2013-10-28 20:29:53','2013-10-28 20:29:53'),(124,'去世之后','丈夫：玛丽，我去世之后，把商店交给查理。 妻子：为什么不给杰克？杰克比查理聪明。 丈夫：好吧，那就把房子给查理。 妻子：查理不是自己有房子吗？我说应该给戴维。 丈夫：好吧，那就把马车给查理。 妻子：可是苏珊住在乡下，她更需要马车。 丈夫：给我住嘴！是我要死还是你要死？','2013-10-28 20:29:53','2013-10-28 20:29:53'),(125,'电话声响起','电话声响起。。。 女：喂！ 男：喂，你猜一下我是谁？ 女：GSBE！ 男：不是！ 女：JACK！ 男：不是！ 女：LEON！ 男：NO！ 女：哦，是KEN！ 男：NO！！NO！！ 女人心想：我的情人都数了啊？ 女：那你是谁啊？ 男大声的说：他们都是谁？！？你连老公都忘了！？？','2013-10-28 20:29:54','2013-10-28 20:29:54'),(126,'魔鬼的妹妹','有一位妇人她老公常常买醉后才回家，于是，她决定要改正他这项恶习。在万圣节当晚，她穿着一件魔鬼戏服，躲在一棵树的后面，准备在她老公回家的路上等他。当他老公走近时，她手持乾草叉，头戴红帽，屁股留著一条长尾巴地跳到他的面前。老公问：“你是谁？”妇人答：“我是魔鬼！ ”她老公接著说：“走！和我一起回去，我已经娶了你妹妹了！ ”','2013-10-28 20:29:54','2013-10-28 20:29:54'),(127,'捏着刹车','夫妻二人骑双人自行车外出郊游。两人吃力而艰难地爬上一个大坡后，丈夫一边喘气一边说道：“这，这个坡，可真，真难爬，累死我了！ ”“可不是，坡度太陡了！要不是我一直捏着刹车，恐怕我们早就滑下去了！ ”妻子擦了把汗说道。','2013-10-28 20:29:54','2013-10-28 20:29:54'),(128,'风流的妻子','丈夫经常听到有关妻子的风言风语，决定调查一下。于是他对妻子谎称出差，假装地收拾行李后，离开了家。到了深夜，他径直奔家而去。奇怪，家门口站了一排男人，为了不打草惊蛇他决定翻墙而入，可是当他刚刚爬上墙就被一个男人揪了下来。那个男人骂道：“你还想加塞儿？站排去！ ”','2013-10-28 20:29:55','2013-10-28 20:29:55'),(129,'粗心的丈夫','格尔·普什卡牵着狗从兽医那里回到了家。他叹着气对妻子说：“我们这条可怜的狗，它一路上一直在叫，仿佛有什么话要对我说！ ”妻子打量了一下那只狗，喊了起来：“蠢货！这只狗大概是想告诉你，它根本就不认识你。”','2013-10-28 20:29:55','2013-10-28 20:29:55'),(130,'受伤的原因','一次叔叔从外面回来时手上包着药布，婶婶见了关心地问原因：你的手怎么受伤了？ 叔叔回答：我在马路上看见一个男孩儿拿着刀子刺向了一个女孩的屁股。 婶婶：这跟你的手有什么关系？ 叔叔：这时我的手刚好在那女孩的屁股上。','2013-10-28 20:29:55','2013-10-28 20:29:55'),(131,'吹灯','从前有家非常吝啬的人家。一天老头到城里办事，感到下腹不适，总是憋着、忍着，最后实在不行了，只好到厕所去了。因到家里，他很高兴地把这事和老婆说了，说没想到只是一个屁。他老婆埋怨地说：你也太不会过（日子）了，留着回来吹灯呀！','2013-10-28 20:29:56','2013-10-28 20:29:56'),(132,'女秘书的初夜','女秘书因工作出色，在老板的撮合下，她和一名能干的职员结了婚。初夜......新郎：小声点儿，别人听到了多难为情！新娘：你说话怎么和老板一样呀！','2013-10-28 20:29:56','2013-10-28 20:29:56'),(133,'象家长','妻子：老公，我穿这件衣服就不象孩子妈妈了吧？丈夫：不象，象家长。','2013-10-28 20:29:56','2013-10-28 20:29:56'),(134,'身价百倍','丈夫，在许多女人眼里，是个一无是处的废物。她们甚至不肯为丈夫多花一个子儿。可一旦丈夫被车撞死，便马上会身价百倍，变得至少值５万美元。','2013-10-28 20:29:57','2013-10-28 20:29:57'),(135,'因何而嫁','为什么你会嫁给你丈夫？一个长舌妇邻居问妻子道，你与他并没有多少共同之处。这是个古老的异性相吸的道理。妻子解释道，那时我怀孕了，而他没有。','2013-10-28 20:29:57','2013-10-28 20:29:57'),(136,'在产院','妻子：“虽然是女儿，但你看这鼻子、这嘴多象你呀，漂亮吧！ ”丈夫：“哼，最重要的东西还不是象你！ ”','2013-10-28 20:29:58','2013-10-28 20:29:58'),(137,'胡子','丈夫：早晨刮刮胡子，感觉年轻了10岁！妻子：哼！如果真那样，就睡觉前刮。','2013-10-28 20:29:59','2013-10-28 20:29:59'),(138,'钓鱼','丈夫热衷於钓鱼,他把自己所钓到的大鱼.名贵鱼拍成相片,贴在床头墙壁上, 并且一一注上它们的名称.重量以及垂钓地点,乐此不疲. 妻子见状,便将自己的玉照挂在丈夫床头,并在旁边注明: 美人鱼 49.5 Kg,钓於人民公园.','2013-10-28 20:29:59','2013-10-28 20:29:59'),(139,'帐单','一位债台高筑的男人绝望的看著那堆帐单，发愁忽然叫到：谁要是能解除我的烦恼。我就给他一千元。我可以，妻子回答，一千元在哪里！那是第一个烦脑呀！丈夫说。 ','2013-10-28 20:29:59','2013-10-28 20:29:59'),(140,'任君选择','丈夫下班回家，妻子准备好了晚饭。 “亲爱的，今晚的菜你可以选择。”妻子说。 “都有些什么菜呢？” “芦笋。”妻子答。 “有什么选择呢？” “你吃或是不吃？”','2013-10-28 20:30:00','2013-10-28 20:30:00'),(141,'埋 怨','在车站的月台上，一对夫妻正在互相埋怨。丈夫望着已经开出的次车对妻子说：“都怪你！要不是你一个劲地磨蹭，我们满可以坐上这趟火车。” “都怪你！ ”妻子回敬道，“要不是你一个劲地催命，我们满可以不用花好多时间等下趟火车。”','2013-10-28 20:30:00','2013-10-28 20:30:00'),(142,'糊涂','夫：“你出去时，可别带那只怪模怪样的花狗去。” 妻：“我觉得那条花狗很可爱。” 夫：“你一定要带着它，是想以它作为对比，显示出你的美貌吧？” 妻：“你真糊涂，如果想那样，我还不如带你出去更好！ ”','2013-10-28 20:30:00','2013-10-28 20:30:00'),(143,'夫妻不同','A教授从研究室回到家中，见桌上装饰着很大的一束花，他就问夫人：“今天是什么日子？” “呀？你忘了么？今天是你的结婚纪念日埃” 他听了，微微一笑：“原来如此，谢谢你！到了你的结婚日，我也买一个大花束来祝贺你。”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(144,'新婚夜的忏悔','新婚之夜，不安的新娘告诉新郎，她有事要向他忏悔。新郎说：“亲爱的，没关系，我知道你跳过脱衣舞。”新娘说：“可是，我要忏悔的是在之前的事。”新郎问：“难道你要说你以前放荡不羁，非常不自爱吗？”新娘说：“是的，在我还没经过变性手术之前....”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(145,'准确部位','妻子说：“孩子不听活，是该打，可你不应该老是扭他的耳朵。”“要扭哪儿？”丈夫问。“打屁股，那是块死肉。”“你真糊涂，屁股听得进话吗？”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(146,'男子汉','齐达内：“你猜我领到工资后会怎么办？” 菲戈：“交给老婆？” 齐达内：“不，是存到银行。” 菲戈：“这才是男子汉。” 齐达内：“然后把存折交给老婆。”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(147,'不是我行是他行','一对夫妇久婚不育，他们检查治疗了很久均未凑效。因此他们非常着急。于是女的受一位朋友的推荐，就去看了一个医生。过了不久，女的怀孕了。喜讯传来，他的丈夫高兴得不得了，对老婆说：“我们终于有孩子了，你真行！ ”他的老婆听了回答说：“不是我行，是那个医生行！ ”','2013-10-28 20:30:02','2013-10-28 20:30:02'),(148,'重要的事','一人早上醒来，发现妻子死在床上。他赶紧跳起来，脸色苍白、跌跌撞撞地奔下楼梯大声喊道：“阿梅！阿梅０ 女佣回答：“先生！什么事？“ “早餐的鸡蛋煮一个就够了０','2013-10-28 20:30:02','2013-10-28 20:30:02'),(149,'某君再婚 新婚之夜……','某君再婚，新婚之夜，灯下看新娘，粉迹深处，皱纹如织，不禁怅然问道： “娘子芳龄几何？” “四十少二。” “不止吧？” “你眼力不错，四十有五了。”“你我既然结为夫妻，何必撒谎呢？” “实不相瞒，实足年龄已五十四了。” 上床后，新郎突然想起盐罐没盖，“我得到厨房把盐罐盖上，免得老鼠偷吃。” 新娘不禁笑了起来：“傻瓜，我活了六十八年，还没有听说老鼠偷吃食盐呢！ ”','2013-10-28 20:30:02','2013-10-28 20:30:02'),(150,'银 婚','一对夫妇上照相馆拍摄一张银婚纪念照，摄影时，摄影师对妇人说：“你靠近一点，手搭在你先生的肩上，这样照起来就会自然一些。”先生苦笑着说：“如果想拍一张更写实的照片，应该让她的手插进我的衣袋里。”','2013-10-28 20:30:03','2013-10-28 20:30:03'),(151,'拳 击  ','夫妻俩常常发生争论，而每次争论的结果，总是妻子赢。每当争论到最激烈的时刻，丈夫就会退出争论而走到地下室去。在那里，保留着一个练习拳击用的吊袋。每次走到那里，他总要对准了吊袋猛击它15分钟，把怒气发泄出去，然后就觉得心情舒畅了o 有一天，形势变了，争论的结果，丈夫赢了。这位丈夫感觉到他那位妻子快要大发脾气了，就建议去试一试他的那个吊袋。妻子接受了他的意见，来到地下室，一连十几分钟的猛击猛捶之后，她回到了楼上，乐得嘴都合不拢了。 丈夫问她：“怎么这样高兴?” 她回答说：“我为什么不应该高兴?我在第三轮就把你打','2013-10-28 20:30:03','2013-10-28 20:30:03'),(152,'虚 惊  ','    妻子抱怨晚上太冷，买了一床电热毯，但丈夫伯不安全，经过半天时间解释，他才肯睡这床电热毯。 在睡前，妻子在烤箱里放了一块火腿，用低温烤着，以便早上起来不必赶做早点。 到午夜后，一阵肉香飘人卧室’丈夫从梦中惊醒，跳起来，摇醒妻子说：“亲爱的，快醒来，我们被烤熟了。”  ','2013-10-28 20:30:03','2013-10-28 20:30:03'),(153,'馅的问题 ','早上找衣服穿准备上班，套了一件久未穿的裙子，对着镜子自语：“唉呀！怎么像包粽子一样。” 在一旁洗脸的老公说：“这就是馅儿的问题啦，可不是叶子的问题。”  ','2013-10-28 20:30:04','2013-10-28 20:30:04'),(154,'将计就计','一个女人在饭馆里责骂她的丈夫。最后，她尖声叫道：“在世界上所有可耻的人中，你是最卑鄙的一个!”这时，饭馆里所有的人都吃惊地看着他们。她丈夫察觉后，马上提高声音说：“骂得太好了，亲爱的!你还对他讲了些什么?”  ','2013-10-28 20:30:05','2013-10-28 20:30:05'),(155,'姐夫的眼睛 ','姐夫个性木讷寡言，与内向的姐姐正好是一对。婚前二人同事3年，彼此虽然有意，却没有勇气表白。后来在同事安排下，他们开始约会了。姐姐羞怯怯地问道：“为什么每次我们四目相投的时候，我总觉得你的眼里有很特别的东西？” 姐夫脸红红地答道：“哎呀！你怎知道我有砂眼的？不过请放心，医生说差不多已痊愈了。”  ','2013-10-28 20:30:05','2013-10-28 20:30:05'),(156,'意外的意外','    在外地出差的丈夫回到家后发现妻子和她的情人在聊天。而且妻子的情人表明他很爱她，她也很爱他。丈夫很生气决定和他决斗。两人到了另外一个屋子里，丈夫说：“我们都朝空中开一枪，然后倒在地上。她进屋后先跑向谁谁就拥有她.”两人商量好后向空中开了一枪。 妻子推门进来，看见两人躺在地上，跑向大衣柜说：“亲爱的出来吧，他们俩个都死了。”  ','2013-10-28 20:30:05','2013-10-28 20:30:05'),(157,'使用说明书  ','婚礼上，司仪问新郎：“准备结婚典礼很忙，期间有没有看看书？比如《新婚必读》之类？” 新郎：“没有。” 司仪：“那你们看什么书？” 新郎：“使用说明书。”  ','2013-10-28 20:30:06','2013-10-28 20:30:06'),(158,'怕老婆','A：你拿了工资怎么处置？ B：交给老婆。 A：看来你不如我。 B：你会怎样？ A：我会把它存进银行，然后…… B：然后怎么样？ A：然后把存折交给老婆。  ','2013-10-28 20:30:06','2013-10-28 20:30:06'),(159,'找个借口','门外传来了敲门声，乔对妻子说：“我敢打赌，准是隔壁的布鲁格那家伙借东西来了，我们家一半的东西他都借过。” “我知道，亲爱的。”乔的妻子答：“可你为什么每次都向他让步呢？你不会找个借口吗，这样他就什么都借不走。” “好主意。”乔走到门口，去接待布鲁格。 “早晨好！ ”布鲁格说，“非常抱歉来打搅您。请问您今天下午用修枝剪吗？” “真不巧，”乔答道，“今天整个下午我要和妻子一起修剪果树” “果真不出我之所料。”布鲁格说，“那么您一定没时间打高尔夫球了，把您的高尔夫球杆借给我，您不会介意吧！ ”  ','2013-10-28 20:30:06','2013-10-28 20:30:06'),(160,'结婚晚了','结婚才5个月，妻子就生下了一个白白胖胖的男孩。 丈夫怀疑地问：“这孩子来得是否太早了点？” “不，”妻子回答。“是我们结婚结得晚了点。”  ','2013-10-28 20:30:07','2013-10-28 20:30:07'),(161,'喝咖啡 ','妻子：“刚才在朋友家里你喝了五杯浓咖啡，你不是说一喝咖啡晚上就睡不着觉吗？” 丈夫：“可是，面对着能白喝的咖啡不喝，回家后我就更睡不着了。”  ','2013-10-28 20:30:07','2013-10-28 20:30:07'),(162,'结婚需要','女:男人结婚需要什麽!? 男:勇气 男:女人结婚需要什麽!? 女:运气  ','2013-10-28 20:30:07','2013-10-28 20:30:07'),(163,'越来越短 ','在舞场上，一位姑娘和一位陌生的男子跳舞。 姑娘问：“您真是一个神奇的人物，跟您一起跳舞，我觉得舞曲变得越来越短了。” 那个男子答道：“这有什么可奇怪的，乐队指挥是我的未婚妻。”  ','2013-10-28 20:30:08','2013-10-28 20:30:08'),(164,'自讨苦吃','丈夫同卖菜人讨价还价地买了几斤廉价藕，满以为可对妻子炫耀，不料，却换来了妻子破口大骂：“笨蛋！为何不买别的菜，这藕一斤少说也有半斤窟窿，还说便宜？”  ','2013-10-28 20:30:08','2013-10-28 20:30:08'),(165,'老头进城 ','一大早，乡下的老头到城里去看儿子，在路上把腰扭伤了。在医院里挂号时拿了个“ 1”号，这时候大夫还没有上班，于是老头就在门外等。过了一会，大夫来了在屋里喊“一（yao）号！ ”。老头不知道在喊自己，就没有做声。大夫喊了两声，见没有人答应就往下喊了。老头见比自己后来的都一个个进去了，很生气。 瞅着一个空子就进去问大夫：“我是 1号怎么还排在别人后面？”大夫看了挂号单说：“1就是一(yao)，以后记好了”然后问老头哪里疼。老头开口就说：“1 疼”。大夫还算聪明，楞了一下就明白了，诊断完后就叫老头去打针。  ','2013-10-28 20:30:09','2013-10-28 20:30:09'),(166,'生命在于运动','丈夫叹道：“唉，我的体质越来越差了。” 妻子挖苦他：“野猪能活50年，而家猪只有5年寿命；野狗能活20年，而家犬只有8年寿命，生命在于运动嘛，谁叫你一天到晚像乌龟一样缩着不动！ ” 丈夫听了反问道：“亲爱的，请问乌龟能活多少年？”  ','2013-10-28 20:30:09','2013-10-28 20:30:09'),(167,'吝啬鬼打架 ','丈夫是个吝啬鬼，因夫妻不和，两人经常吵架，一天晚上夫妻又在家里吵闹，越吵越凶，最后厮打起来。正打得难解难分的时候，丈夫的衣服被撕破了，桌上的热水瓶也被妻子撞倒砸碎了，丈夫见状，心痛地叫道：“别打了，要打，咱们脱光衣服到外面去  ','2013-10-28 20:30:09','2013-10-28 20:30:09'),(168,'同床异梦 ','夜深了，夫妇两早已入睡。妻子突然做了个梦，她惊慌地推醒丈夫：“你快走，我丈夫回来了！ ” 丈夫大吃一惊，说道：“真倒霉，我这就走！ ”说完就跳上了窗户……  ','2013-10-28 20:30:10','2013-10-28 20:30:10'),(169,'继续喂金币','男人正在看书，女人大声呼唤男人：“老公，快来，我看见你儿子把一枚硬币放入口中，我倒提着他的腿，结果吐出来两枚硬币，你看是不是要上医院？”男人大怒说：“不，傻瓜，赶快再喂硬币，再倒提双腿。”女人愕然。  ','2013-10-28 20:30:10','2013-10-28 20:30:10'),(170,'老婆与名片','前几天我在此处发表了两篇所谓的“笑话”，一个叫“我是你老婆”，另一个叫“名片的故事”；几天后，我特意留意了一下；您猜怎么了？内容非常好笑的“名片的故事”只有14423个人去看，而内容只有一句话---- 你是我老婆的“我是你老婆”却有近三万人去看之，您说我们的心理是怎么回事？是不是大家都有了些毛病？我想我们中国人的目前状况就是如此吧；多么希望大家能把业余的时间都用在学习上，把自己培养成一位有能力的人，老是追求另样心理和刺激，我们的老大中国迟早会被世界看不起的；你将没有未来。  ','2013-10-28 20:30:11','2013-10-28 20:30:11'),(171,'现实的女人','大愚告诉朋友：“哎，我两次向丽丽求婚她都不答应。后来我就告诉她我叔叔特别有钱，可以给我们买一套大房子。”朋友于是问：“丽丽后来同意了？”大愚伤感的说：“是的，她已经是我的婶婶了。”  ','2013-10-28 20:30:11','2013-10-28 20:30:11'),(172,'便宜的东西','情人节时。 女：亲爱的！我喜欢大大的玩偶！ 七夕时。 女：亲爱的！我喜欢法国香水！ 生日时。 女：亲爱的！钻石代表永！ 圣诞节时。 女：亲爱的！我。。。 男：等一下，宝贝！你有没有喜欢便宜的东西？ 女：有啊！我最喜欢你了！  ','2013-10-28 20:30:11','2013-10-28 20:30:11'),(173,'谁跳的高 ','   记者问跳高冠军“你知道谁跳的最高？”“我老婆”跳高冠军回答 记者又问“什么时候？”答“拿了奖金不给她时 她跳得比我还高”  ','2013-10-28 20:30:12','2013-10-28 20:30:12'),(174,'治疗失眠','有一对夫妇经营着牧常由于过度操劳，丈夫患上了失眠症。常常整夜睡不着觉。于是妻子告诉他，睡不着觉时就躺在床上默默地数羊，便会慢慢地睡着。他依法试了，仍不奏效。 “你准是太心急了，必须专心一意地数，并且数到1万才会有效。今晚你再试试。” 第二天早晨，丈夫恨恨地说：“仍是一夜没睡着！我数完了1万只羊，剪了羊毛，梳刷妥当了，纺织成布，缝制成衣，运往美国，全都卖出去了，整笔买卖赚了321万元！ ”  ','2013-10-28 20:30:12','2013-10-28 20:30:12'),(175,'狗 名','妻子：“我想给小狗起个名字叫‘拜伦’，母亲说这样会侮辱了这位诗人；后来我想把你的名字改给它，母亲又说不好。” 丈夫：“你的母亲真好。” 妻子：“她说这样会侮辱了小狗。”  ','2013-10-28 20:30:13','2013-10-28 20:30:13'),(176,'乱世情缘','一一你刚才是和谁打招呼呀? 一一他是我第二个丈夫的第一个妻子的第三 个丈夫。 一一你竟然记得! 一一因为现在他是我丈夫。  ','2013-10-28 20:30:13','2013-10-28 20:30:13'),(177,'纯洁的新娘','汤姆本是一个花花公子。有一天突发奇想要改邪归正，并找一个天底下最纯洁的少女与其结婚。经过一翻努力终于如愿。婚后第二天，杰克在酒馆见到愁霉苦脸的汤姆，说到：“你刚结婚为什么不在家陪着新娘子？而一个人在这里喝闷酒。”“嗨！你不知道，今天早上一起床，我随手给了她一百圆钱。”“你可以和她好好解释解释，认个错吗。”杰克说。“不是应为这个，而是她紧跟又找了我二十圆钱。”  ','2013-10-28 20:30:13','2013-10-28 20:30:13'),(178,'唱歌的太太','曾太太每天都在唱歌他的老公都躲在阳台上，今天曾太太又在唱歌，他老公又躲在阳台上，曾太太生气的问老公：你难道一点都不欣赏我的歌声吗？他老公说：我只是想让别人知道～我并没有打你  ','2013-10-28 20:30:14','2013-10-28 20:30:14'),(179,'男仆的故事','一个名叫詹母斯的男仆为一对富有的夫妇做事。妻子非常漂亮，比丈夫要年轻许多。一天晚上他们告诉詹姆斯他们要出去很晚，但妻子孤身一人比预订时间早就回家了。 “詹姆斯，”她说，“到我房间来。”他跟着走了进去。她关上房门，说到：“把我的衣服脱下来。”他照做了。“现在，把我的袜子脱下来，”她接着说。他将长袜卷了下来。“脱掉我的内衣。”他将那些也都脱了下来。 “现在，詹姆斯，”她盯着他的眼睛说，“不要让我再逮着你穿我的衣服！ ”  ','2013-10-28 20:30:14','2013-10-28 20:30:14'),(180,'细心的太太 ','某男因公事要很晚回家, 细心的妻子怕丈夫回家后找不到他需要的东西, 就在临睡前写了张字条放在桌上:“ 亲爱的, 啤酒在冰箱里第三层, 烤鸡在微波炉内,我在床上”。  ','2013-10-28 20:30:14','2013-10-28 20:30:14'),(181,'美好人生','丈夫杰克是一个电视迷。一天他问他的妻子今天有什么新的剧情，妻子说：“ 罗娜的丈夫因为抢劫而被捕，露丝堕胎了，杉姆跳楼了，茹如因为吸毒而死，他的妹妹没钱上学，汤姆袭警被抓。” 丈夫叫到：“这部片子叫什么名字？”妻子说：“美好人生。”  ','2013-10-28 20:30:15','2013-10-28 20:30:15'),(182,'窃听器 ','新婚夫妻蜜月旅行,住进一家客店.晚上新郎正要关灯,新娘不安地问新郎:“屋里会不会有窃听器?“ “不会有,亲爱的.“新郎安慰她. “万一有窃听器,那多难堪!“ 新郎四处查看.最后掀开地毯,果然发现一个小巧的玩艺儿.新郎拧开外圈,除去中间的硬块后上床去了. 第二天早上侍者叫醒了这对夫妻,问他们昨晚睡得可好? “很好,谢谢!“新郎不满地问,“干么这么早来打搅我们?“ “非常抱歉!“侍者说,“因为住在你们楼下的夫妻昨晚发觉有只吊灯落在他们身上!“  ','2013-10-28 20:30:15','2013-10-28 20:30:15'),(184,'遗 传','    一老汉见儿媳很漂亮起了歪心，但也没有好办法，整天唉声叹气。老婆问为什么，老汉如实告知，老婆说：你就威胁她说若不怕丢人就声张，就看谁更丢人。词法果然奏效。老汉满意后问老伴怎么想到这个办法的，老伴说：当年你老爸就是用这个办法得到我的。 ','2013-10-28 20:30:16','2013-10-28 20:30:16'),(185,'心在这里 ','有置妾者，与妻行乐，妻曰：“你身在这里，心自在那里。”夫曰：“若然，待我身在那里，心在这里何如？”  ','2013-10-28 20:30:16','2013-10-28 20:30:16'),(186,'黑色幽默','妻（趴在丈夫的病床边）：你一定不能死，汤姆。我偌大一个衣橱里，连一件黑衣服也没有。 夫（对游泳教练）：你可以教我太太淹死吗？  ','2013-10-28 20:30:16','2013-10-28 20:30:16'),(187,'军人的需要 ','一位新婚军人写信给他的太太说： 假如能的话，你下礼拜来看我吧。我生理上感到需要，而且也缺钱用，所以请你带一百块来。 Ps：若不能来就寄两百块给我。  ','2013-10-28 20:30:17','2013-10-28 20:30:17'),(188,'听谁说','恋爱后是他说她听，订婚后是她说他听，结婚后是两人说邻居听。','2013-10-28 20:30:17','2013-10-28 20:30:17'),(189,'和她不熟','布郎森夫妇结婚已有三十年了。布郎森先生每天外出上班，他妻子则在家里操持家务。一天晚上，布郎森太太羡慕地对丈夫说：“对面楼上搬来一对年轻夫妻，我注意他们很久了。那个男的帅小伙儿每天出门都要与妻子吻别，回家时也要亲吻妻子，人家多亲热呀！你为什么就不能这么做呢？”“可是，我和那位女士还不怎么熟埃”丈夫为难地说。','2013-10-28 20:30:17','2013-10-28 20:30:17'),(191,'幸运','两个酒鬼在一起喝酒，其中一个说道:“我真倒霉，我的老婆拿走了我所有的财产跑了。”另一个酒鬼说道:“老兄，你还是挺幸运的，我的老婆拿走了我所有的财产，但是她还不肯走！ ”','2013-10-28 20:30:18','2013-10-28 20:30:18'),(192,'某老公撒谎的最高境界','有一对夫妇，丈夫很喜欢打保龄球但也很怕老婆，老婆很爱抽烟，一天晚上，老婆发现在自己的烟抽完了，便叫丈夫去买，丈夫没有办法只好去买，可是已经很晚了，附近的小卖部都关门了，这可把丈夫急坏了，丈夫突然想到酒吧应该有卖烟的，于是丈夫去了，到了酒吧那个丈夫一眼就看见吧台座着一位漂亮的小姐，于是他走过前去跟那位小姐聊天，然后就一起去开房。到了半夜，丈夫突然想到忘了给自己的太太买烟了，又怕自己的太太知道这件事后会打死他，于是他就问那位小姐有没有滑石粉，小姐很奇怪但还是给他了，丈夫将滑石粉涂到自己的手上就回家了，刚进家门','2013-10-28 20:30:18','2013-10-28 20:30:18'),(193,'狗和丈夫','丈夫抱怨说：“亲爱的，你把我的名字给了咱们的小狗，这样我会经常弄错的。” “不会的，叫狗时我的声音特别和蔼。”','2013-10-28 20:30:19','2013-10-28 20:30:19'),(194,'明天检查妇科','夜晚，一对夫妇躺在床上。丈夫温柔的拍妻子的肩膀并开始摩擦妻子的手臂，妻子转过身说：亲爱的，对不起，我明天要去看妇科医生，我想保持清洁。丈夫遭到拒绝，无奈的转过身去准备睡觉了。可过了几分钟，丈夫又转过来开始温柔的拍妻子的肩膀，这次他凑到妻子耳边轻轻的问：明天你也要去看牙医吗？','2013-10-28 20:30:19','2013-10-28 20:30:19'),(195,'80岁的夫妻','一对80岁的夫妇想要个孩子。他们去医生那里咨询，医生表示是可能的，并给这对夫妇一个瓶子，让他们采集精子和卵子然后医生来给他们人工授精。第二天，夫妇俩把一个空瓶子还给了医生。医生奇怪的问到：怎么了。老人回答：昨天我们一回家就开始了，我先是用自己的手弄，但没效果，然后我夫人用她的手帮我，也没用，于是她又用她的嘴，后来她手口并用，连牙都用上了，可我就是就是……“就是无法勃起是吗？”医生问到。 “不是”老人回答“我就是打不开这个瓶子盖！ ”','2013-10-28 20:30:19','2013-10-28 20:30:19'),(196,'今晚才做的东西','一对新人在教堂举行结婚典礼，到了互换戒指的时候，紧张过度的新郎竟然忘了这件事。 牧师非常焦急的举起手指，做出套戒指的动作，并眨着眼睛暗示新郎。 只见新郎胀红着脸，结巴地说：“牧师，那不是今晚洞房之夜才做的吗？”','2013-10-28 20:30:20','2013-10-28 20:30:20'),(197,'超级老色鬼','李是一位结过婚的老色鬼，有天老李的老婆要求老李带她去牛肉场，但老李不肯可是他老婆硬要老李只好答应了。老李一开始一进场时里面的小弟马上向老李问好:嗨老李!他老婆瞪他一眼老李也不敢说什么。Show开始后广播响起:老李请上贵宾席!老李只好带他老婆一起去坐贵宾席，等Show演到最后时女主角脱掉内裤，台上女主角问:这件内裤要给谁？台下观众不约而同的说:给老李！Show终于结束了老李带老婆去搭出租车一上车老婆非常不高兴的打老李一巴掌出租车司机说:老李呀，你今天带的妞真凶呀。','2013-10-28 20:30:20','2013-10-28 20:30:20'),(198,'快躺到床上去','瓜瓜在捷运高架道路旁买了一栋三楼的房子…… 每回电联车通过时，噪音都很大，瓜瓜的太太还感觉到床铺会震动。某天她实在是忍受不住了，于是打电话给房屋中介公司，向售屋经记人员抱怨…… 那位年轻的经记人赶到了她家，实在不相信床铺会震动…… 瓜瓜的太太生气地说：“不相信的话，你自己躺到床上去就知道了” 年轻的经记人于是脱了外套躺到床上，这时瓜瓜正好回家，看到这样的情景，大声质问说：“你在干什么？” 年轻的经记人一脸无辜地说：“我如果告诉你，我在等捷运经过，你会相信吗？？？”','2013-10-28 20:30:20','2013-10-28 20:30:20'),(199,'是谁干你的','出海两年多的的船员阿福终于回到家乡。但，一回到家的他却发现多一个婴儿！阿福激动的问着妻子：“是谁干的好事？是不是隔壁的阿呆？”“不是。”妻子回答“是不是我的朋友阿瓜？”“不是。”“一定是小王，我那该死的酒肉兄弟！ ”“烦死人了！ ”妻子叫道：“难道我就没有自己的朋友吗？”','2013-10-28 20:30:21','2013-10-28 20:30:21'),(200,'妻脱光倒立镜前','某男久不行房,妻很难受。一日他要妻脱光倒立镜前,妻大喜照办。他将妻双腿分开，将自己下巴放于妻阴部后问妻：我留胡子好看吗？','2013-10-28 20:30:21','2013-10-28 20:30:21'),(201,'那天我偷看了老婆的日记','不经意发现老婆还有个小本本，仔细一看，原来是日记： 1.今天买菜多向老公报了10元钱，自己也应该一点一点地攒私房钱了。2.对老公撒谎说丢了100元钱，装作很懊悔的样子。我要用这钱护理护理头发，省得他埋怨我每次做头都在浪费钱。 3.给老公买了一件T恤，明明是80元，我告诉他花了150元。既让他觉得穿着体面，我又得了实惠，真是一举两得。 4.在老公面前表现得百依百顺，温柔体贴，抢着干家务，在他飘飘然的时候，向他提出购买我心仪已久的裙子，虽然贵了点，他居然同意了，原来美人计是如此好用！ 5.结婚纪念日前一天，准','2013-10-28 20:30:21','2013-10-28 20:30:21'),(202,'南非的女人做事后','有一位丈夫放下杂志看看太太说：我刚晓得。 \n南非的女人在每次的房事完毕之后都会给先生八块钱。 \n这么好的机会我怎么能错过明天我就去南非。 \n太太叫道：我也要去。 \n先生：你去干什么。 \n太太：我去看看你一个月只赚十六块怎么活下去。','2013-10-28 20:30:22','2013-10-28 20:30:22'),(203,'屠夫嫖妓被抓','屠夫嫖妓被抓罚4000元并开收据.一日屠夫妻发现此收据,只识4000元不识‘嫖妓二字,问屠夫：何事罚4000元？屠夫答到：罚我肉中注水!','2013-10-30 01:55:10','2013-10-30 01:55:10'),(204,'歹徒闯入民宅','歹徒闯入民宅强奸妇女遭到誓死反抗，丈夫下地回来见老婆被歹徒压住，抡起铁铲怒拍，就听老婆骂道：“该死的,反抗了半天，被你一铲子给拍进去了。”','2013-10-30 01:55:11','2013-10-30 01:55:11'),(205,'','','2013-10-30 01:55:11','2013-10-30 01:55:11'),(206,'','','2013-10-30 01:55:11','2013-10-30 01:55:11'),(207,'根本没什么胸部','丈夫向妻子抱怨:你买那么贵的胸罩干嘛?你根本没什么胸部嘛!? 妻子非常生气的答道:照这么说你买内裤的钱都可以统统省下来啦!! 丈夫:@%!?……','2013-10-30 01:55:12','2013-10-30 01:55:12'),(208,'七年一样','甲女：“我同丈夫结婚到现在，七年以来，丈夫对待我，总是与结婚那天一样。” 乙女：“我昨夜还听见你们二人争吵的呢！ ” 甲女：“是的！丈夫与我结婚那天，就争吵的。”','2013-10-30 01:55:12','2013-10-30 01:55:12'),(209,'教育机会','老张在电梯里注视一个美丽的长发女郎，目不转睛，张太太非常不高兴，突然；那个女郎转过身来，给了老张一个耳光，说道：“我教训你下次别偷捏女孩子。” 当夫妇俩走出电梯的时候，老张委屈地对太太悦：“我并没有捏她呀！ ” “我知道，”张太太说，“不过，我捏了她。”','2013-10-30 01:55:13','2013-10-30 01:55:13'),(210,'','','2013-10-30 01:55:13','2013-10-30 01:55:13'),(211,'偷听夜晚同房事','有一个新来的太监怕睡着了听不见皇上的吩咐又怕耽误皇上和娘娘的好事自作主张藏在了床底下。 第二天早上被发现。 皇上道:“好你个奴才在朕的床底下待了几个时辰？”太监跪倒在地答道:回皇上的话奴才在床下过了五更天。 “你都听到了什么？” 一更天您和娘娘在赏画。 “此话怎讲？” 听您和娘娘说……“来让我看看双峰秀乳。” “二更天呢？” “二更天您好像掉地下了。” “此话怎讲。” “听娘娘说:你快上来呀！ ” “三更天呢?\"你们好像在吃螃蟹。” “此话怎讲？” “听您在说:把腿掰开!” “四更天呢？” “四更天好像您','2013-10-30 01:55:13','2013-10-30 01:55:13'),(212,'几个月和老婆做','记者在北极访问爱基斯摩人。 \n记者：听说北极有几个月的时间一直是白昼，那你们怎样度过呢？ \n爱基斯摩人：我们捕鱼啊！当然也跟老婆做、爱。 \n记者：那连续几个月的黑夜，你们做什么？ \n爱基斯摩人：我们就不捕鱼啦。','2013-10-30 01:55:14','2013-10-30 01:55:14'),(213,'比一比床上技术','话说有一对很有钱的年轻夫妇，家里请了一堆管家，司机，女佣等。而女主人总是怀疑丈夫和年轻美貌的女佣有染，于是总是想找机会把她给fire掉，终于有一天趁先生不在把女佣给叫过来，嫌她菜烧得不好要叫她走路。 “可是，女佣说：先生总是说我菜煮得菜比你好。” 女主人顿时妒火攻心，哑口无言，只好说：“没事，你下去吧！ ” 正当女佣走到门口时，回头冒了一句“而且我的床上工夫也比你好！ ” 女主人顿时愤恕的拍桌子说\"这也是先生说的吗？\" “不是，女佣回答，是司机，园丁他们说的。”','2013-10-30 01:55:14','2013-10-30 01:55:14'),(214,'新婚夜准备洞房时','洞房之夜，新娘已脱衣服上床。新郎也脱掉上衣、衬衫、领带，但是到了鞋子的地方就碰到了麻烦，因为鞋带解不开，愈弄愈连在一起，新娘着急着说： “真笨，那儿有小刀，用刀了割断算了！ ” 新娘的母亲为了要了解一切是否顺利，便在隔壁房间偷听。当听到新娘如此说，便大叫“不行！不可以用刀子，”她隔墙说，“告诉他，涂上一些口水，就行了。”','2013-10-30 01:55:15','2013-10-30 01:55:15'),(215,'彩色的保险套','有一个人想尝试新奇的事,便跑到情趣商品店买彩色的保险套他看到两个彩色的套子,一个是黑色的,一个外型像是米老鼠他决定买那个黑色的回家,并跟太太大战了几回合不过那个套子并没发生什作用,后来他太太怀孕了经过九月之后生下小 baby,再经过 6 年之后孩子长大了这个小孩有一天问他老爸: “为什么哥哥姊姊的肤色都是白的而我却是黑的?” 爸爸回答道:“孩子,你没长得像米老鼠就该谢天谢地了”','2013-10-30 01:55:15','2013-10-30 01:55:15'),(216,'细心的老婆','话说一对年轻夫妻有一个刚开始牙牙学语时, 做老公的常看老婆常常很用心的教导孩子“叫爸爸”,这个做老公的大受感动, 认为太太真好先教孩子叫爸爸 ,而不是先叫妈妈,觉得真幸福。 有一个寒冬深夜,孩子哭闹不休一直叫爸爸, 此时夫妻俩睡的正好,老婆就推了推老公说你儿子一直在叫你,你赶快去啦, 这时老公才知“原来如此……” ','2013-10-30 01:55:15','2013-10-30 01:55:15'),(217,'新人赶快入洞房','江西两家中药铺联姻，男姓龙，女姓陈。 有一熟稔男女两家的落地书生，虽想说家中没钱，但不去赴宴，又说不过去。只好硬着头皮前去观礼。 然而，看着他人所送的贺礼，实在不好意思，想说就此拜别；但双方的家长冲着交情，硬是要这书生留下合宴。 耳热酒酣之际，家长就说话了： “即然你有读过书，写幅联就当贺礼好了！ ” 书生一听，就说： “即然都是开药铺的，那就用两家的姓、药引、药性出对好了。” 可是，书生写了对联、横批后，结果是哄堂大笑！闹着新人赶快入洞房—— 上联：陈皮两片，去痰消肿既解渴； 下联：龙骨一根，退烧止痒又','2013-10-30 01:55:16','2013-10-30 01:55:16'),(218,'男子匆匆地说','一位男子匆匆进来对店员说：“朋友，暂时把橱窗里那件名贵大衣收起来好吗？” 店员看在小费的份上，答应了，并怀疑地问：“这是为什么？” 男子说：“等一会儿我的女朋友要来买大衣。”','2013-10-30 01:55:16','2013-10-30 01:55:16'),(219,'你丈夫回来了','有一对夫妻新婚不久。丈夫被公司派到外国常驻了。一年之后，丈夫休假回家。当晚一阵云雨之后，夫妻俩鼾然入睡。 半夜突然响起敲门声。丈夫从睡梦中一跃而起，惊呼：“不好！你丈夫回来了！ ”妻子嘟哝了一声：”不可能，他在外国呢。”','2013-10-30 01:55:16','2013-10-30 01:55:16'),(220,'你就像那一把刀','新婚之夜刚过，王小二要妻子对自己做出评价。妻子说：“你就像那一把刀。” 听了妻子的话，小二得意地笑了说：“你是在表扬我很不错吧？”他的妻子回答说：“瞧你那小样！我说你就像那一把刀，是说你好快好快！ ”','2013-10-30 01:55:17','2013-10-30 01:55:17'),(221,'重温新婚之夜','结婚三十周年了，这对老夫妻决定重新回到新婚之夜所住的旅馆重温一下。丈夫躺在床上，妻子从浴室中走出，几乎全裸就象三十年前一样。她挑逗地站在床边问丈夫：“告诉我亲爱的，30年前我象这样从浴室里出来时，你是怎么想的？” “当时我看着你想我要把你的脑子挤出来，把你的乳房吸干。” “那你现在在想什么”妻子急切地问。 “我在想我的工作成绩不错呀！ ”','2013-10-30 01:55:17','2013-10-30 01:55:17'),(222,'夫妻同色','宴会中有一个自命风流的男士，他突然低声的对女主人玛莉说：“玛莉，今晚的宴会真棒啊！假如我能找到一个一拍即合的女人，能不能暂借用你的雅室，给我们幽会一下？” 亲切率真的玛莉答道：“没有问题，只是你的妻子怎么办？” “别担心，我只去几分钟，她不会想到我的。”男士说。 女主人笑笑的点点头说：“的确，我想她是不会想到你的。因为在十分钟前她才向我借过卧室。”','2013-10-30 01:55:18','2013-10-30 01:55:18'),(223,'老公避灾守则','老公避灾守则 ．能够说谎话时，就别说实话； ．非说实话不可时，就先说好话； ．好话成效不错时，则适时的加入谎话。 ','2013-10-30 01:55:18','2013-10-30 01:55:18'),(224,'老公缄默定律','老公缄默定律 1.当老婆对时，绝对闭嘴不说她不对； 2.当老婆不对时，先看她脸色对不对； 3.不管她对或是不对，你说的永远不对。','2013-10-30 01:55:18','2013-10-30 01:55:18'),(225,'细心的老婆','话说一对年轻夫妻有一个刚开始牙牙学语时, 做老公的常看老婆常常很用心的教导孩子“叫爸爸”,这个做老公的大受感动, 认为太太真好先教孩子叫爸爸 ,而不是先叫妈妈,觉得真幸福。 有一个寒冬深夜,孩子哭闹不休一直叫爸爸, 此时夫妻俩睡的正好,老婆就推了推老公说你儿子一直在叫你,你赶快去啦, 这时老公才知“原来如此……” ','2013-10-30 01:55:19','2013-10-30 01:55:19'),(226,'老公信念守则','老公信念守则 1.深信自己能改变老婆 2.若无法改变&8231;就加强信念 3.还是改变不了老婆&8231;则改变信念','2013-10-30 01:55:19','2013-10-30 01:55:19'),(227,'爱妻六大守则','爱妻六大守则 太太绝对不会有错。 如果发现太太有错，一定是我看错。 如果我没看错，一定是我的错，才害太太犯错。 如果是她自己的错，只要她不认错，她就没有错。 如果太太不认错，我还坚持她有错，那就是我的错。 总之，太太绝对不会有错，这句话绝对不会错。','2013-10-30 01:55:19','2013-10-30 01:55:19'),(228,'火炉也怕我老婆','一天男人生炉子，吹了半天也没把火吹着，反而弄了一头灰。男人便拿老婆的长裙顶在头上，一吹炉子着了，男人感叹的说：“哎！连炉子都怕我老婆。” ','2013-10-30 01:55:20','2013-10-30 01:55:20'),(229,'夫妻夜话','婴儿诞生了，每天午夜，宝宝总要哭闹一番，妻子总是摇醒我：\"起来，亲爱的，去看看宝宝为什么哭？\" 后来，我用书中介绍的方法让宝宝安静地睡了。可是午夜，妻子又把我摇醒：\"起来，亲爱的，看看宝宝为什么不哭？\"','2013-10-30 01:55:20','2013-10-30 01:55:20'),(230,'女人的情人','女人在家正和情人幽会，男人打电话来，情人问：“谁？”女人说是男人。情人立即要走，女人说：“别走，他说正和你在办公室打牌，晚一些回来。”','2013-10-30 01:55:21','2013-10-30 01:55:21'),(231,'方便的时候','一位小姐约她的很是腼腆的男朋友出去玩,过了一会儿,男的说道:\"对不起,我要方便方便一下,但不知道哪儿可以\",女的明白是什么意思,就领他到了附近的厕所,男的出来以后,女的问他:\"你什么时候去我家?\"男的想了想说道:\"就在你方便的时候吧.\"','2013-10-30 01:55:21','2013-10-30 01:55:21'),(232,'','','2013-10-30 01:55:21','2013-10-30 01:55:21'),(233,'好烫','老婆：“亲爱的，这肉丝好不好吃？” 老公：“马马乎乎。” 老婆：“这鱼呢？” 老公：“将就。” 老婆：“那这豆腐呢？” 老公：“一般。” 老婆按捺不住吼道：“你就不能说个好字？” 正喝着汤的老公大叫道：“好烫！ ” ','2013-10-30 01:55:22','2013-10-30 01:55:22'),(234,'妙语','妻子外出几天，留下一些家务活给丈夫做。一、二、三、四，写在纸条上，出于开玩笑，又在纸条上加上第五条：“多想想你的妻子。”几天后，妻子返家，丈夫向她报告完成家务情况，并递回条子；条子上四条已划了叉叉，只剩下第五条未划。“我一出家门，你就不想我啦？”“第五条我也照做了，但还没有做完。”丈夫回答。','2013-10-30 01:55:23','2013-10-30 01:55:23'),(235,'追星族','一次争吵后，老酷让气得无话可说，于是向对老婆一咧嘴：“我真成你的追星族啦！ ” 老婆转怒为喜：“是吗？” 老酷慢条斯理摇头晃脑：“我追的是颗扫帚星。” ','2013-10-30 01:55:23','2013-10-30 01:55:23'),(236,'各国的离婚规定','日本：如果丈夫认为妻子睡姿不好看，就可以提出离婚申请。 意大利：妻子不干家务或不喜欢干家务，丈夫便可以提出离婚。 阿富汗：如果女方提出离婚，那么她再嫁人时，她的再婚丈夫要付给前夫两倍当年婚礼费用；如果是男方提出离婚，女方重新嫁人时，新郎丈夫要偿还前夫和妻子当年的婚礼费用。 英国：夫妻双方只有一方可以提出离婚，如果双方都提出离婚，则不准离婚。 黎巴嫩：在传统的家庭中，女人出门前先要征得丈夫的同意。如果有朝一日不想要妻子，待妻子出门前征求他的意见时，他只需说：“快去，别回家了！ ”便由此宣告离婚。 多哥：男女','2013-10-30 01:55:25','2013-10-30 01:55:25'),(237,'赠物','老公送给还活着的老婆一块墓碑。上面如此刻着：“我老婆长眠于此，有如生前一般的‘冷感’。” 老婆也回送老公一块墓牌：“我老公长眠于此，好不容易才真正‘硬’起来。” ','2013-10-30 01:55:25','2013-10-30 01:55:25'),(238,'关于吻','老婆说：你看隔壁的小张多好，每次出去都吻他的老婆，你该象他学学啊老公说：不行啊，我跟她不熟啊！！！ ','2013-10-30 01:55:26','2013-10-30 01:55:26'),(239,'蜜月','一个画家结婚了。蜜月之后，有人问新娘：“婚后生活怎么样，海伦？”她回答说：“太好了！我丈夫画画，我做饭。然后，我们就猜测他作的画和我做的饭究竟是什么。”','2013-10-30 01:55:26','2013-10-30 01:55:26'),(240,'吝啬','一对地主夫妇，出名地吝啬。一天男的进城去，走着走着想上厕所，但转念一想：这 么好的肥料可不能便宜了别人。于是一直憋着。后来实在憋不住了，找个厕所就上。 可是也除了放几个屁之外，什么也没有拉出来。于是心中得意不已。回到家里，向老 婆讲述自已的经历。谁知老婆一听大怒：你这个败家子，哪有你这样过日子的，省下这几个屁来吹灯该多好！ ','2013-10-30 01:55:28','2013-10-30 01:55:28'),(241,'新婚夫妇','一对年轻恋人决定结婚，当大日子接近时，两个人都有一点害怕，每 一个人都有一件秘密没有告诉对方。准新郎终于决定找他父亲寻求建议。 他对父亲说：“我很担心我的婚姻会有问题，会失败。”他老爸问：“怎 么了，你不爱这位女孩吗？”准新郎说：“爱，非常爱，但是我的脚很臭， 我怕结婚后，她会厌恶我的脚臭，连带的厌恶我。”老爸说：“这简单， 你只要常常洗脚，随时都穿袜子，即使睡觉都穿袜子。”准新郎想了一想， 觉得是可行的解决方案。准新娘则把问题告诉她母亲：“妈，当我每天早上醒来时，我的嘴里 的气味很臭，我怕会把我老公吓跑','2013-10-30 01:55:28','2013-10-30 01:55:28'),(242,'关于婚外恋','妻子：现在电视里老演婚外恋，你说，你会有婚外恋吗？ 先生：不会。 妻子：为什么？ 先生：有你一个我就够后悔的了，决不能再要第二个','2013-10-30 01:55:28','2013-10-30 01:55:28'),(243,'古巴来的','丈夫出期不意的回到家，看到床边的烟灰缸仍有冒着烟的雪茄，满腹狐疑的瞪着那根雪茄，对着缩在床头抖缩的妻子咆哮:“这从那里来的？” 一阵沉寂之后，从衣橱中传出发抖的男人的声音：“古巴… ”','2013-10-30 01:55:29','2013-10-30 01:55:29'),(244,'过节','要过逾越节了。一对新婚夫妇不懂繁琐的节日礼仪，于是 丈夫叫妻子去偷看邻居铁匠家是怎么过的。妻子走近窗口，看 到铁匠正在用煤铲打老婆呢！妻子回家后，丈夫问她看见了什 么，她始终不肯说。最后，丈夫气急了，拿起煤铲打她。她哭 着说：“既然你都知道，还派我去干什么？”','2013-10-30 01:55:29','2013-10-30 01:55:29'),(245,'薄情的妻子','史密斯先生突然病逝。他的太太边哭边说：“你连件纪念品都没有给我留下，就离开了我，让我多想你呀！ ” 她哭了几声，突然对医生说：“请借一把锤子给我用一用。” 医生问道：“太太，要锤子干什么用？” “我要他的一颗牙作纪念。” “最好保持你丈夫遗体完整，要别的行吗？” “不行，那可是颗金牙呀！ ” ','2013-10-30 01:55:29','2013-10-30 01:55:29'),(246,'请朋友吃饭','“亲爱的，”丈夫对妻子说：“我邀请了一位朋友回家吃晚饭。” “什么？你疯了吗？我们的房子乱糟糟的，我很久没有买过东西回来了，所有的碗碟都是脏的，还有，我可不想做一餐累死人的晚饭。” “这些我全都知道。” “那你为什么还要邀请朋友回来吃晚饭？” “因为那个可怜的笨蛋正考虑要结婚呢。” ','2013-10-30 01:55:30','2013-10-30 01:55:30'),(247,'丈夫和小保姆','一女士，回家后，发现丈夫同保姆睡在一起。为了摆平此事，丈夫答应给妻子买件皮裤子。为了表示改邪归正，丈夫要赶保姆走。妻子说：且慢，我还想要件皮大衣呢！','2013-10-30 01:55:31','2013-10-30 01:55:31'),(248,'补裤子','妻子：“昨天晚上你睡觉以后，我把你裤子口袋里的破洞补好了。你说，我是不是一个很体贴你的人？”丈夫：“那当然！你一直对我很体贴。可是，你是不是可以告诉我，你是怎么发现我的裤子口袋破了一个洞的？”','2013-10-30 01:55:32','2013-10-30 01:55:32'),(249,'公鸡和母鸡','母鸡对公鸡每天天不亮就叫，吵得睡不着觉，早就不满了。 母鸡对公鸡说：“现在的科学证明，太阳并不是你喊才出的，你天天早上喊空口号，你烦不烦人。” 公鸡反驳道：“你不喊口号，那是你的嗓子没我的好，不嘹亮。” 母鸡说：“俗话说得好，叫鸡公不下蛋。你呀，要多学习一点东西，多做点实事。” 公鸡说：“你怎么还是老观念，现在医学发达了，你肚子里的货，实际是我给你的。没有我，你肚子能有什么货。你干什么实事？不就是下下鸡蛋嘛，这蛋在肚子里不下来行吗？那憋得多难受，跟我拉屎一样，拉下来就舒服了。” 母鸡反驳道：“是你的货，那','2013-10-30 01:55:32','2013-10-30 01:55:32'),(250,'我的天啊，这可怎么得了','  甲：我妻子读完《恼人的兄弟俩》这本书后，生了一对双胞胎。   乙：那算不了什么，我妻子读完大仲马的《三个火枪手》后，生的是三胞胎。   丙：我的天啊，这可怎么得了，我妻子正在读《阿里巴巴和四十大盗》呢！  ','2013-10-30 01:55:32','2013-10-30 01:55:32'),(251,'郊外的一夜','    两个女人在郊外喝酒，一直喝到天蒙蒙亮。回来的路上，她们内急难忍，于是硬着头皮走进路边的一片墓地。因为没带手纸，第一个女人便脱下内裤擦了擦，并扔掉了内裤。第二个女人发现旁边有个花圈，便撕下挽联擦了擦。   两个女人回家后没多久，他们的丈夫便互通电话。    “看来我们得当心了，昨晚她们俩肯定有事儿，我发现我老婆回来后没穿裤!\"“我更糟，我发现我老婆屁股上贴着一个纸条，上边写着：‘我永远不会忘记你’！ ”','2013-10-30 01:55:33','2013-10-30 01:55:33'),(252,'完美的借口','一个正在办派对的女人要她的老公提水桶跑到沙滩上去捡一些蜗牛，满心不愿的丈夫答应了妻子，但是这位丈夫却在沙滩上邂逅了一位美丽的女郎。。。 隔天一早，他醒来时就惊呼：“完了！我老婆的派对！ ”他拾起所有衣物，以最快的速度把它们穿上，拿起水桶，冲向家里，由于他跑的太快，快到家的时候，不小心掉了水桶，弄得家门口都是蜗牛。此时，怒气冲冲地老婆出来了，他赶忙回头望着蜗牛道：“加油啊！兄弟们，咱们就快到啦！ ” ','2013-10-30 01:55:33','2013-10-30 01:55:33'),(253,'未必模范','“我丈夫真笨，既不会喝酒又不会赌钱。”“那你真幸运，找了个模范丈夫。”“可他不会喝酒却偏要喝，不会赌钱却偏要赌。”','2013-10-30 01:55:33','2013-10-30 01:55:33'),(254,'','','2013-10-30 01:55:34','2013-10-30 01:55:34'),(255,'夫妻对话（1）','妻：「对于性你有什么看法？」 夫：「看法是没有，做法倒很多。」 ','2013-10-30 01:55:35','2013-10-30 01:55:35'),(256,'谁更倒霉','妇产科医院的候诊室前，有两个准爸爸不安地踱步著，等待妻子生产。其中一位叹气地说：真倒霉啊！这事刚好碰到我在休假...另一位则说：我比你更倒霉，我现在还在度蜜月哩！','2013-10-30 01:55:35','2013-10-30 01:55:35'),(257,'军人的需要','一位新婚军人写信给他的太太说： 假如能的话，你下礼拜来看我吧。我生理上感到需要，而且也缺钱用，所以请你带一百块来。 Ps：若不能来就寄两百块给我。 ','2013-10-30 01:55:37','2013-10-30 01:55:37'),(258,'并不奇怪','妻子眼泪汪汪地对丈夫说：“记得前几年，你对我是那样体贴，那样忠实。而现在呢？你动不动就发脾气……简直成了两个人！ ” 丈夫哼了哼鼻子：“前几年……前几年那是因为咱俩还没结婚。” ','2013-10-30 01:55:38','2013-10-30 01:55:38'),(259,'金婚纪念','“你今天为什么衣冠楚楚的，查理？”“庆祝金婚纪念日。”“你开什么玩笑，你才结婚5年。”“可它对我来说就像整整50年！ ”','2013-10-30 01:55:38','2013-10-30 01:55:38'),(260,'新婚第一夜','新婚第一夜，新娘子为了“办事”，早就换上了漂亮的丝睡袍，作出诱惑的姿势躺在床上。 可是一个小时过去了，新郎还是穿得好好的看着窗外，新娘不耐烦地提醒他：“怎么不脱衣服上床来？”他回答说：“你先睡吧！不要管我，因为我妈妈跟我讲过，今天晚上是我所能见到的最美妙的一个晚上，所以现在我不想浪费任何一秒钟看夜景的机会。” ','2013-10-30 01:55:38','2013-10-30 01:55:38'),(261,'名医的过去','有个医生沉默寡言。别的医生看病总要先向病人左询右问，方才下诊断。可他不等病人开口，自己也不说话就动手治疗。邻居们对他夫人说：“您先生真是名医高手，您脸上多光彩啊！ ”夫人说：“是不是名医我不知道，不过以前很长时间，他一直干兽医。”','2013-10-30 01:55:39','2013-10-30 01:55:39'),(262,'决不侵犯','地板上放着一盆待洗的衣服，拉拉杂杂的家务活摆在眼前，妻子抱着未满周岁的孩子，急得团团转，她恳求丈夫：“这么多活你就不能帮我干点。”她丈夫慢悠悠地说：“你的权益我决不能侵犯。”','2013-10-30 01:55:40','2013-10-30 01:55:40'),(263,'谁 对','夫妻吵架后，丈夫骂道：“你该记住，无论什么时候，男人的思考都是对的，判断准确无误，而女人却是恰恰相反！ ”“是呀，你选我做妻子是绝对正确的，而我选你做丈夫是大错特错的！ ”','2013-10-30 01:55:41','2013-10-30 01:55:41'),(264,'新娘守则','新娘守则 一、含蓄矜持，谦卑有礼， 不得有拍手大笑健步如飞之行为。 二、听到黄色笑话，一律装作不懂， 不得有恍然大悟连呼\"安可\"之行为。 三、婚礼上饮酒，以三小杯为限， 不得有豪兴大发与来宾划酒拳之行为。 四、忍受新郎与自己之装扮， 不得自认有沐猴而冠伸手遮脸之行为。 五、即使汗流浃背，亦要装作若无其事， 不得有撩起长裙猛吹电风扇之行为。 六、来宾致辞祝贺新人多子多孙时， 不得有摇头反对出声抗议之行为。 七、坐于定位， 不得有自由行动查看签到簿上礼金多寡之行为。 八、专心应酬， 不得有于假发或头套中暗藏随','2013-10-30 01:55:41','2013-10-30 01:55:41'),(265,'老公生存法则','老公生存法则 1.别跟老婆谈具有争议论性的话题。 2.若有争论时，尽可能不要有结论。 3.如果非有结论不可，则以老婆的结论为结论。','2013-10-30 01:55:42','2013-10-30 01:55:42'),(266,'老公劳力定律','老公劳力定律 1.能自己做的就自己做； 2.自己不能做的就推给老婆做； 3.老婆做完后，为补破洞做的比自己做的还要多。','2013-10-30 01:55:43','2013-10-30 01:55:43'),(267,'家书','一对夫妻刚结婚但是丈夫还在部队当兵， 有一天丈夫收到太太寄来的一封信， 上面写着:我在家里OOO你在军中OXO 丈夫看了不懂得其中的涵意， 于是他就去请教部队的弟兄帮忙翻译， 他问一个中文系的说： 我在家里对对对，你在军中对不对 他觉得不对， 于是又问一个数学系的说： 我在家里圈圈圈，你在军中圈叉圈 他觉得也不对， 于是他又问一个化学系的解出来说： 我在家里氧氧氧(痒)，你在军中氧不氧(痒) 于是他马上请假回家去了....','2013-10-30 01:55:43','2013-10-30 01:55:43'),(268,'捐款','某年某月的某天，有某对新人结婚，在婚礼完毕后……伴郎：「你怎一副苦瓜脸？」 新郎：「呜……刚刚我问牧师说应该要付多少费用？他本来说不收费的；但又说有人根据新娘的美丑来捐献：新娘越漂亮，捐的越多。」 伴郎：「那你给多少？」 新郎：「1元……」 伴郎：「那你赚到了ㄚ！哭啥？」 新郎：「可……可是，他竟还找我5毛９ 伴郎：「…………」','2013-10-30 01:55:43','2013-10-30 01:55:43'),(269,'自由恋爱','一户人家正在闹新房，大家要新郎新娘谈谈是怎样相识而结婚的。新娘含羞他说：“我俩是自由恋爱。”新郎连忙补充说：“不错，是自由恋爱，我把十多年来的积蓄全交给了你母亲，才使你得到了自由。”','2013-10-30 01:55:44','2013-10-30 01:55:44'),(270,'离 婚','丈大：“孩子他娘。咱们离婚好吗？”妻子：“咱们从来下吵不闹，为什么要离婚？”丈夫：“我的意思是，离婚以后我再和你结婚。”妻子：“阿你今天发神经疯了还是怎么着？”丈夫：“没有啊！你看，这几年年轻人结婚，把我的腰包都掏空了，如果我们不再结一次婚，这些践怎么捞得回来哟？','2013-10-30 01:55:45','2013-10-30 01:55:45'),(271,'垂帘听政','丈夫：“以后来了客人，凡谈公事你少插嘴，注意一下影响。”妻子一翻白眼：“你懂个啥，这叫垂帘听政。”','2013-10-30 01:55:45','2013-10-30 01:55:45'),(272,'唠叨','电台台长为了调查电台的收听率，决定在星期天晚上打电话给1000个男人。“请问您现在在听什么？”对于每个男人都这样问道。“正在听老婆唠叨。”在这1000个男人中，有934人是这样回答的。','2013-10-30 01:55:46','2013-10-30 01:55:46'),(273,'学外语','一对上年纪的夫妇来到夜校报名学外语。老太太说，“我们刚刚收养了一个外国孩子，他快满一岁半了，很快会讲话了，我们很想听听他对我们说的话。”','2013-10-30 01:55:46','2013-10-30 01:55:46'),(274,'半字','有个人花五百两银子买了个监生（官名），但他却孤陋寡闻，没什么学问。妻子劝他读点书，他却问：“读书有什么好处？”妻子说：“一字值千金，如何不好？”监生回答说：“难道我这个身子，只值得半个字？”','2013-10-30 01:55:46','2013-10-30 01:55:46'),(275,'布口袋','一官吏的乌纱帽被妻子打架时踩破了。他很生气，还向皇帝奏了一本：“启奏陛下：臣妻很是罗嗦，昨天与臣吵架，踩碎臣的纱帽。”皇上见了后传旨道：“爱卿你要忍耐，皇后也有此毛病，与朕一言不合，即将皇冠打得粉碎。你的纱帽算个什么，顶多是个布口袋！ ”','2013-10-30 01:55:47','2013-10-30 01:55:47'),(276,'再不敢睡','一惧内者，忽于梦中失笑，其妻摇醒他问：“你梦见何爷？如此得意。”丈夫不能瞒，说：“梦娶一妾。”妻大怒，罚跪床下，起来拿家法打他。丈夫说：“梦幻虚情，如何认作实个？”妻子说：“别样梦许你做，这样梦个许你做。”丈夫说：“以后不做就是了。”妻子说：“你在梦里做，我如何知道。”丈夫说：“既然这样，待我夜夜醒到天明就是了。”','2013-10-30 01:55:47','2013-10-30 01:55:47'),(277,'不幸中的大幸','妻子一回家，丈夫就对她说：“今天真是不幸中的大幸。”妻子忙问：“怎么回事？”丈夫说道：“咱们的驴子不见了。”妻子说：“怎么还有大幸？”丈夫说道：“幸亏当时我没有骑驴上，不然连我也丢了。”','2013-10-30 01:55:48','2013-10-30 01:55:48'),(278,'梦中对话','“亲爱的！ ”丈夫在梦中嘟噜着，“把电视机关掉吧，把被褥铺好，再递给我一杯热茶。”“不行啊，我的胖小子！ ”躺在丈夫身旁的妻子回答，“我们是在电影院里。”','2013-10-30 01:55:48','2013-10-30 01:55:48'),(279,'模范丈夫','妻子：“我还想看《模范大夫》。”丈夫：“昨天咱们不是刚看完吗？”妻子：“我在家里也想看。”丈夫恍然大悟，赶快走进厨房。','2013-10-30 01:55:49','2013-10-30 01:55:49'),(280,'明天再来','酒鬼丈夫在外面喝醉了酒，很晚才回到家。他又忘记带钥匙了，于是只好敲门。妻子开门出来，由于天黑，没认出自己的丈夫。妻子：“很对不起，我丈夫不在家。”丈夫：“那好，我明天再来。”','2013-10-30 01:55:49','2013-10-30 01:55:49'),(281,'补脑药水','老李特别爱喝啤酒，但他妻子却说喝啤酒也伤身体，坚决不允许他喝，老李突生一计，把啤酒倒进补脑药水瓶里，说这是医生让喝的，还让妻子尝过。妻子信以为真，于是他天天都能喝上啤酒了。有一天，老李的妻子去赴宴，有人请她喝啤酒。她推辞不过，勉强尝了一口，立刻吐了出来：这哪里是啤酒，不要骗我！这分明是补脑药水！ ”','2013-10-30 01:55:51','2013-10-30 01:55:51'),(282,'怕死才吸烟','妻子：“你看看这篇文章，吸烟多有害处。科学家说，吸一支烟要减少生命六分钟，我看你还是把烟戒掉。”丈大：“你是想谋害我。”妻子：“我劝你戒烟是要你爱惜身体，怎么说是谋害你？”丈夫：“你没见这篇文章中还说，不吸烟的人吸入空气中的烟雾，比吸烟的人遭受的危害更大。我们办公室里的人都吸烟，我一个人不吸，不是要遭大危害？我是怕死才吸烟的。”妻子：“那么，以后你每天给我和女儿也各买一包香烟。”丈夫：“……”','2013-10-30 01:55:52','2013-10-30 01:55:52'),(283,'丈夫权威','电车售票员恶狠狠地对一个女人说：“你怎么还不回去？魂不在身上么？”旁边一个客人打抱不平，叫道：“卖票的！你太没规矩了！敢欺侮女人么？女人，也是客人。”售票员笑了：“她是我的老婆。”','2013-10-30 01:55:52','2013-10-30 01:55:52'),(284,'减掉两公斤','“亲爱的，你看，我的体重又减掉了两公斤。”“是吗？”丈夫说，“你可是刚刚起床，要知道，你还没有梳妆呢。”','2013-10-30 01:55:52','2013-10-30 01:55:52'),(285,'胖妇的忧虑','一个胖妇人对丈夫说：“使我发愁的不是我的体重，而是我的高度。按照体重与身高的比例，我应该高2．3米。”','2013-10-30 01:55:53','2013-10-30 01:55:53'),(286,'骑马减肥','一个肥胖的贵妇人，听从了医生的劝告，准备减肥。她让丈夫给她买上一匹好马，打算每天骑上一个小时，丈夫替她办好了这件事。一个月过后，一天，贵妇人骑马归来，正好遇见办事回来的丈夫，丈夫朝她望了望说：“下降了20公斤！ ”“噢，真的吗！ ”贵妇人高兴地叫了起来。“对，”丈夫说道，“我指的是咱们的马。”','2013-10-30 01:55:54','2013-10-30 01:55:54'),(287,'婚后的变化','“你说为什么有的男人结婚后变得像个女人一样？”“这是因为有些女人结婚后变得像男人一样。”','2013-10-30 01:55:55','2013-10-30 01:55:55'),(288,'总得有人留下','丈夫在看晚报，当他读完一篇《女子的寿命比男人长》的文章后，便问妻子：“我真不知道为什么男人要先走一步？”妻子解释道：“总得有人留下来收拾衣服吧！ ” ','2013-10-30 01:55:55','2013-10-30 01:55:55'),(289,'条件反射','夜晚，两夫妇正熟睡。突然妻子在梦中大叫道：“不好，我丈夫回来了！ ” 丈夫被惊醒，想也来不及想，立即从窗口跳了出去。','2013-10-30 01:55:56','2013-10-30 01:55:56'),(290,'婚 外 情','“新婚的激情已经消退了。”甲对乙诉苦。“那干吗不来点刺激的，比如说婚外情什么的？”乙对甲建议。“如果我妻子知道了怎么办？” “这都什么年代了，直接告诉她不就得了”于是甲回到家中对妻子说：“亲爱的，我想一次婚外情会使我们更爱对方的。”“快放弃这个愚蠢的念头吧，”妻子说，“我已经试过了－－根本就不灵！ ”','2013-10-30 01:55:56','2013-10-30 01:55:56'),(291,'情有可原','监狱里，狱史对犯人说：“你老婆看你来了。” 犯人问道：“请问她叫什么名字？” 狱史不耐烦地说：“你难道连自己的老婆的名字都不知道？”犯人答道：“难道你不知道我犯的是重婚罪。”','2013-10-30 01:55:56','2013-10-30 01:55:56'),(292,'美丽与愚蠢','丈夫问妻子：\"为什么上帝把女人造得既美丽又愚蠢呢？\" 妻子说：\"这很简单，把我们女人造得美丽，你们男人才会爱我们；把我们造得愚蠢，我们才会爱你们！\"','2013-10-30 01:55:57','2013-10-30 01:55:57'),(293,'释 疑','妻子：\"为什么每当我唱歌的时侯，你就要到阳台上去？\"丈夫：\"因为我想让邻居知道，我并没有打你。\"','2013-10-30 01:55:57','2013-10-30 01:55:57'),(294,'内在之美','女儿即将嫁做人妇，做母亲的难免在她身旁唠叨的叮咛：“女儿呀！婚姻是终生的一件大事，可不能当作是儿戏。在结婚之前是必须慎重选择的。绝不能因对方外在条件的俊美潇洒，家世富有就要嫁给他。更重要的是他的内在到底如何？我们外人无法看得见，只有你与他朝夕相处，才可以体会出来。现在你们马上就要结婚了，你到底对他的内在了解有多少呢？” 女儿听了害羞又腼典的说：“妈呀！您放心啦，说实在的，我们在一起睡过了，他的那个内在，我看过好多遍了，长得顶吓人的，而且乌漆么黑的，但是每次他跟我来，都让我觉得好满足。”','2013-10-30 01:55:57','2013-10-30 01:55:57'),(295,'要有口德','有一个女人长的粉抱歉..长的丑就算了还超没有口德的.. 一次..被安排要相亲.. 但是男主角迟迟未出现..这女人就等的不怎麽耐烦.. 就开始破口大骂..哇哩勒..竟然敢让你老娘等这麽久..&%$&^$%@!$!%..批哩啪啦的骂了一串.. 此时..男主角出现..是个胖子.. 这女人看了更是火..於是又是批哩啪啦的骂了一串..指着男主角骂着..死胖子..%$^@&.. 男主角终於发飙了.. 拍了桌子..大声的说.. 竟然骂我胖... 亨..至少我曾经瘦过...你你你..你美过吗...','2013-10-30 01:55:58','2013-10-30 01:55:58'),(296,'我不是专家','有一对夫妻，老公正看着电视，啃着瓜子，忽然间老婆从厨房喊着：“老公，可不可以帮我修电灯？” 老公不耐烦的说：“我又不是水电工！ ”没多久老婆又喊：“老公，可不可以帮我修冰箱？”老公不耐烦的说：“我又不是电器维修工！ ”又过了一会老婆又喊：“老公可不可以帮我修酒柜的门？”老公觉得很烦，生气的说：“我又不是木工！ ”然后就跑到外面喝酒解闷，过了一小时，老公觉得心有愧疚，决定回家把那些东西修一修，但是回家后，发现东西全修好了，便问老婆：“东西为什么都修好了？”老婆说：“你离家后，我就伤心的坐在门外，碰巧有一个年','2013-10-30 01:55:58','2013-10-30 01:55:58'),(297,'秃 头','妻子问丈夫：“你儿童时代有过许多愿望，那么现在有没有实现了的？”丈夫摸摸自己的秃头说：“有。小时候，妈妈揪我的头发时，我希望自己是个秃头。”','2013-10-30 01:55:58','2013-10-30 01:55:58'),(298,'不准乱开发','妻：为什么你不让我去隆胸！夫：你难道不知道不可以在山坡地乱开发吗？','2013-10-30 01:55:59','2013-10-30 01:55:59'),(299,'代替丈夫','结婚不到一个月的小李，因一次车祸意外，不幸去世了，他的妻子深受打击，痛不欲生。她丈夫生前的好友志明上前安慰她，还说“愿意代替她的丈夫”。“但是会得到同意吗？”妻子泪眼汪汪的问。“这还要得到谁的同意呢？”志明疑惑的说。“当然是殡仪馆啊！ ”','2013-10-30 01:55:59','2013-10-30 01:55:59'),(300,'情急之举','“小张，你的气色不好，出了什么事？”“我昨晚快天亮才回家，正在脱衣睡觉时，太太醒来了，问我为什么起得如此早。我只好又穿上衣服来上班。”','2013-10-30 01:55:59','2013-10-30 01:55:59'),(301,'妻子与情妇','问：“妻子与情妇之间真正的区别是什么？”答：“晚上与白天。”','2013-10-30 01:56:00','2013-10-30 01:56:00'),(302,'代理丈夫','两个女友在交谈，其中一个死了丈夫。 “你为什么不再找一个丈夫？” “因为我养了狗，鹦鹉和猫了。” “什么意思？” “狗常常叫喊，鹦鹉常常发出不愉快的声音，猫在深夜也不回来。”','2013-10-30 01:56:01','2013-10-30 01:56:01'),(303,'证明','儿：“您帮我证明一下牛顿的万有引力定律。”父：“好，你知道用功了，我怎样帮你呢？”儿：“先把大苹果挂起来。”','2013-10-30 01:56:01','2013-10-30 01:56:01'),(304,'分 歧','丈夫：“你看对门新搬来的夫妻俩，那女的姿态多么娇美，多么漂亮！ ”妻子：“不！我看还是那男的来得潇洒、风流！ ”','2013-10-30 01:56:12','2013-10-30 01:56:12'),(305,'形影相随','一位学者在新婚燕尔之际，仍然手不释卷地读书。妻子忿忿地埋怨道：“但愿我也能变成一本书。”学者疑惑不解地问：“为什么？”“只有这样，你才会整日整夜地把我捧在手上。”妻子说。看到新婚妻子满腹怒气，学者说：“那可不行---要知道，我每看完一本书就要换新的……”','2013-10-30 01:56:12','2013-10-30 01:56:12'),(306,'白天不敢','妻子：“昨天晚上你老是说梦话，你自己知道吗？”丈夫：“不知道，我说了些什么？”妻子：“你好像在骂我。” 丈夫：“有这种可能，因为我白天不敢骂。”','2013-10-30 01:56:13','2013-10-30 01:56:13'),(307,'有恃无恐','晚上，有贼进了家，妻子叫道：“咱家来了个贼！ ”丈夫说：“住嘴！别打扰他，我真希望他能找到点东西，如果有的话，我倒可以从他手里夺回来！ ”','2013-10-30 01:56:13','2013-10-30 01:56:13'),(308,'称　赞','张太太问张先生：“我这套衣服好看吗？”张先生：“任何衣服穿在你身上都好看！ ”“那我戴这条项链好看吗？”“任何项链戴在你脖子上都好看！ ”“那你说我先生好看吗？”“大太！任何一个先生站在你身边都好看！ ”','2013-10-30 01:56:14','2013-10-30 01:56:14'),(309,'抖地毯','“帮我打扫房子吧！ ”妻子对丈夫说。“亲爱的，我不舒服。你瞧：我的手在打颤……。”“那更好，你可以毫不费力地抖抖地毯！','2013-10-30 01:56:15','2013-10-30 01:56:15'),(310,'足球员的妻子','“我妻子有时真象裁判员一样狠，”一位足球运动员说，“她昨天向我出示红牌并把我推下了床。”“这算不了什么，”他的队友说，“我那位仅由于我的合理冲撞就把我驱出席梦思，并找了一名替补。”','2013-10-30 01:56:15','2013-10-30 01:56:15'),(311,'殷勤的丈夫','丈夫抱回家一台吸尘器，兴奋地对妻子说：“我为你买了世界上最好的吸尘器。”说着，他把咖啡未、烟灰……撤在客厅的地毯上，“不信你看，只要我手一按钮，这些垃圾立即无影无踪，否则，我顿时把它们吃下去。”妻子听了，平静他说：“看来你非吃不可了。”“绝对不会！ ”“会的，因为今天停电。”','2013-10-30 01:56:15','2013-10-30 01:56:15'),(312,'节约与小气','儿子问爸爸：“节约与小气有什么区别？” 爸爸说：“当我舍不得给自己买东西时，你妈妈说我是节约；当你妈妈跟我要东西我给她买不全时，她就说我是小气。”','2013-10-30 01:56:16','2013-10-30 01:56:16'),(313,'妻子的疑惑','夫被妻子盯得很紧，每日的薪金都如数交给妻子，只有一点刚够买香烟的零钱。一天，丈夫兴高采烈地回家，对妻子大叫：“亲爱的，我中奖了！有5000元呢？妻子吃惊地问道：“你哪里来的钱买彩票？','2013-10-30 01:56:16','2013-10-30 01:56:16'),(314,'火上浇油','法官：“他在打你以前，你有没有设法阻止他？”原告：“有啊！我用各种最恶毒最难听的语言去阻止他，可是他仍然狠狠地揍了我一顿。”','2013-10-30 01:56:17','2013-10-30 01:56:17'),(315,'珍珠','老妻对老夫说：『人家慈禧太后下葬时口中都含著一颗大珍珠，在百年之后的我一定也要含些甚么东西才有面子。』老夫说：『你要含贡丸还是樟脑丸？』','2013-10-30 01:56:17','2013-10-30 01:56:17'),(316,'两夫妇','夜晚两夫妇正熟睡。突然妻子跳起来大叫道：“不好，我丈夫回来了！ ”丈夫被惊醒，想也来不及想，立即从窗口跳了出去。','2013-10-30 01:56:17','2013-10-30 01:56:17'),(317,'婚外情','＂新婚的激情已经消退了。＂甲对乙诉苦。 ＂那干吗不来点刺激的，比如说婚外情什么的？＂ 乙对甲建议。 ＂如果我妻子知道了怎么办？＂ ＂这都什么年代了，直接告诉她不就得了。＂ 于是甲回到家中对妻子说：＂亲爱的，我想一次婚外情会使我们更爱对方的。＂ ＂快放弃这个愚蠢的念头吧，＂妻子说： ＂我已经试过了－－根本就不灵！＂','2013-10-30 01:56:17','2013-10-30 01:56:17'),(318,'怕你伤害我','话说，一位胖胖的小姐，嫁给一位瘦瘦的先生。老婆掌管家中大小事，她说1，老公不敢说2。一天，老婆心血来潮，一反常态，装出嗲嗲的声音，撒骄的说：老公！你爱不爱我？老公以肯定的声音回答：当然爱！老婆听了便心满意足的继续做家事。隔了几分钟，老婆又按耐不住，跑去问老公：“老公，老公，你刚才说爱我，是不是怕伤害我？”这次老公以颤抖的声音回答说：“不！我是怕你伤害我。”','2013-10-30 01:56:18','2013-10-30 01:56:18'),(319,'把衣服剥光','有位年轻的太太，向医生诉苦说：“结婚才一年，丈夫就对她厌倦了。”“没问题！ ”医生说：“我把这些药粉给你，你偷偷把它放在咖啡里让他喝，但千万不能多用，因为药效很强的。”三天后，这个太太又来了，看起来很兴奋。“怎么？是不是还要一盒？”“不！ ”这个太太向医生但白：“效果非常好！我先生把咖啡放下后，马上跳了起来，把我的衣服剥光。”“哦——效果这么强？”医生惊讶地说。“不过，伤脑筋的是，我们再也不好意思到那家咖啡厅去了！ ”','2013-10-30 01:56:18','2013-10-30 01:56:18'),(320,'月色朦胧干傻事','妻子：“有人说，一个人在朦胧的月色中，容易做出傻事。你说有道理吗？” 丈夫：“是这样，我记得，我是在一个月色朦胧的晚上向你求的婚。”','2013-10-30 01:56:18','2013-10-30 01:56:18'),(321,'我感觉好好啊','一个男人周五下午离开家去上班。这天是发薪日，因此他没有回家，整个周末在外面与男人们狂欢，并花光了他的全部薪水。周日晚上他终于回到家里时，火冒三丈的妻子正等着他，连珠炮似的对他的所作所为骂了将近两个小时。最后，妻子停止了喋喋不休的责骂，问他：“要是你也连着两三天见不到我，会作何感想？” 他回答说：“我会感觉挺好的。” 这句话说完后等着他的就是老婆送来的一顿拳打脚踢.................... 周一过去了，他没看见妻子。 周二和周三也过去了，他还是没有看见他妻子。 到了周四 肿消了一些，他终于勉强','2013-10-30 01:56:19','2013-10-30 01:56:19'),(322,'想要女人的男人','有一个男人，当他妻子临死时，他很悲伤地问她道：“妻呀！你死了之后，要使我当光棍了。现在趁你未绝气之前，先问你一句话：你死后，叫谁来做我的续弦夫人呢？你平日心中有否这个女人呢？”他妻子听了，虽在临终的时候，也挣扎起整个身体，怒气冲冲地骂道：“你这无情的男子，我尚未气绝，你就想续娶。像你这种忘恩负义的男子，谁个女人肯嫁你？你的后妻，一定是阎王的母亲无疑。” 丈夫听了，摇摇头、说：“这样不可！一误不可再误。我已娶了阎王的女儿于先，难道还要娶阎王的母亲于后吗？”','2013-10-30 01:56:19','2013-10-30 01:56:19'),(323,'','','2013-10-30 01:56:19','2013-10-30 01:56:19'),(324,'那个会有力点','数学教授给妻子发了份传真： 你知道54岁的你已经无法满足我的要求，因此，当你看这份传真的时候请不要生气，我将与18岁的女秘书去喜来登饭店，可能下半夜才能回去。 当教授到抵达饭店，他也收到了一份传真： 你也54岁了，当你收到这份传真的时候，我正与一个18岁的小伙子在希尔顿饭店。既然你是数学家，你应该非常清楚18岁的他和54岁的你哪个会坚持更久，所以，晚上不用等我回来啦。','2013-10-30 01:56:19','2013-10-30 01:56:19'),(325,'我什么条件都答应','女：“我和你结婚还有个条件。” 男：“亲爱的，你说吧，只要能和你结婚，我什么条件都答应。” 女：“这个条件很简单，我要把我妈带来，因为她只有我一个女儿。” 男：“这……” 女：“怎么，你不同意？” 男：“你不是不知道，现在商店都在反对搭卖？！ ”','2013-10-30 01:56:20','2013-10-30 01:56:20'),(326,'太太跟情妇也在…','酒吧中喝酒的两个男士，其中一位瞥见酒吧另一角落也坐着两位女士。 “快走吧，我看见我的太太和情妇正坐在那边角落的椅子上。”这位男士突然脸色仓白地对他的同伴说。 第二个男士顺着第一个男士的手指方象看去，脸色也马上变了。“奇怪，怎么我的太太跟情妇也正坐在那里？”','2013-10-30 01:56:21','2013-10-30 01:56:21'),(327,'夫妻间爱做的事','在民初时代，因人民生活困苦，所以通常全家人睡在同一张床上，盖同一床棉被。 在冬季的某日夜晚--小明的爸爸忽然想和小明的妈妈做爱做的事。。 但是小明的妈妈害怕会吵醒小明，拒绝了爸爸的要求，小明的爸爸仍然霸王硬上弓。。。 于是两人盖起棉被开始做那档子事。 就在两个越做越热烈时，小明的爸爸突然要求妈妈配合叫出声来。 但妈妈怕吵醒小明，坚持不肯，就在两人坚持不下时，睡在旁边的小明终于开口说话了：“。。妈妈，您赶快叫了，我好冷哦！ ”','2013-10-30 01:56:22','2013-10-30 01:56:22'),(328,'我玩过很多女人','有一男人酒后吹自己有好几打相好的，妻子说：“不过是娘子军里的一个班长”。丈夫又说又吹玩过的女人实际比这多得多。妻子说：“充其量不过是娘子军里的一个排长。” “要是你老婆杠上劲，一天给你捞个班长，一个星期给你捞个排长。不是吹牛，集团军司令不好说，给你捞个师长团长还不成问题。”妻子接着说。','2013-10-30 01:56:23','2013-10-30 01:56:23'),(329,'蜜月的每个晚上','一个贵族小姐马上就要结婚了，母亲告诉她说：“当度蜜月上床时，不应该马上将所有的衣服都脱掉，要保持一点矜持。” 度完蜜月回来后，新郎问他的岳母：“你们这家庭有没有人精神不正常的呢？” “没有啊！怎么回事？” “你女儿在我们度蜜月时，每天都带帽子睡觉。”','2013-10-30 01:56:24','2013-10-30 01:56:24'),(330,'脱下内裤后','男脱下衣服给女友看二头肌说:这相当于五十公斤炸药,又脱下裤子指着大腿说:这相当于一百公斤炸药。接着脱下内裤,女友夺门狂奔,惊叫道:天呐!引线这么短!','2013-10-30 01:56:24','2013-10-30 01:56:24'),(331,'夫妻激烈运动','夫妻二人骑双人自行车外出郊游。两人吃力而艰难地爬上一个大坡后，丈夫一边喘气一边说道：“这，这个坡可真陡，真难爬，累死我了！ ”妻子附和道：“可不是吗，要不是我一直紧捏着刹车，咱们早滑下去了。”','2013-10-30 01:56:24','2013-10-30 01:56:24'),(332,'和她妹妹在一起的','一位男子悲伤的对酒友说：“没想到我太太对我不忠，她告诉我昨晚她和她的妹妹在一起，可实际上，昨天晚上我是和她妹妹在一起的！ ” ','2013-10-30 01:56:25','2013-10-30 01:56:25'),(333,'何时有理','“我丈夫与我从来没吵过架。”一妇女眉飞色舞地炫耀。“他有理时，也没吵过吗？”“我不知道他何时有理，从来就没有那样的时候。” ','2013-10-30 01:56:25','2013-10-30 01:56:25'),(334,'太太至上','某夫妇新婚，洞房内贴有家规，上面写着：第一条：太太永远是对的。第二条：如果太太错了，请参阅第一条。','2013-10-30 01:56:26','2013-10-30 01:56:26'),(335,'需要安静','“我去过医院了。”丈夫对妻子说。“医生怎么说？”妻子问。“他让我好好休息，要绝对安静。这是他给开的安眠药。”“好的，我会照顾你按时服药的。”“不，这药是给你开的。”丈夫说。','2013-10-30 01:56:26','2013-10-30 01:56:26'),(336,'庆幸','音乐家去世了，他留下遗嘱，请求把长笛与他埋在一起。“天哪，幸亏当年他没学钢琴。”他的遗孀庆幸地说。','2013-10-30 01:56:27','2013-10-30 01:56:27'),(337,'不安','清晨，鲍勃脸色苍白。他的妻子关心地问道：“怎么，不舒服吗？”“昨天夜里，我做了个梦，我去意大利旅游，而且还品尝了意大利细面条。”“这有什么值得不安？”“可是今天起来，我却发现我睡裤的系带不见了。”','2013-10-30 01:56:27','2013-10-30 01:56:27'),(338,'减少损失','“真傻，手表被抢时，你为什么不呼救呢？”妻子责备他说。“如果我大声呼救，他们就会发现我嘴里还有4颗金牙，那损失就更大了。”被抢的男人说。','2013-10-30 01:56:27','2013-10-30 01:56:27'),(339,'期待','夫妇俩一起去参观新潮美术展览，当他们走到一张仅以几片树叶遮掩下部的裸体女像油画前，丈夫目瞪口呆地站在那里，很长时间都不离开。妻子忍无可忍，狠狠地揪住丈夫吼道：“喂！你想站到秋天，等待树叶落下来才甘心吗？”','2013-10-30 01:56:28','2013-10-30 01:56:28'),(340,'治疗','杰克意外受伤，住进医院。妻子去看他，他强烈地亲吻着妻子。恰好有位护士走进房间，见状马上回身把门带上。结果，这次探访的时间很长，谁也没有进来打忧。他们觉得很奇怪，直到妻子打开门时才明白，原来门上挂着块牌子，上面写道：“正在治疗，闲人免进。” ','2013-10-30 01:56:28','2013-10-30 01:56:28'),(341,'恐惧的原因','一天，老张与老吴下班的时候一起走在大街上，突然身后传来急促的喇叭声，只见老张神色紧张地急忙躲到一旁，老吴不解地问道： 「你怕什么？我们在人行道上，车子撞不到我们呀９ 老张抚着怦怦乱跳的胸口解释道： 「哎！你有所不知，差不多一个月前，我老婆跟一个计程车司机跑了，自此以后，每当我听到喇叭声就会吓一大跳，深怕那个计程车司机又将我的老婆送回来９','2013-10-30 01:56:30','2013-10-30 01:56:30'),(342,'无题','湖边，一个画家正在画画，身后来了一男一女两口子。他们看了一会儿，最后丈夫以无可辩驳的口吻对妻子说：“看见了吧，亲爱的，不买一个相机，该有多苦恼哇！ ” ','2013-10-30 01:56:31','2013-10-30 01:56:31'),(343,'不解风情','太太抱怨先生：“你一点也不了解女人的心，总不愿意讲我爱听的。” 先生：“好嘛，你爱听什么就提醒一下吧。” 太太：“至少称呼得改一改，不要老叫‘老婆’，叫三个字的，亲昵一些的。” 先生：“我明白了，老太婆。” ','2013-10-30 01:56:31','2013-10-30 01:56:31'),(344,'取名字','一个妇女在生孩子的时候很痛苦，她咬着牙一字一顿地说：“宁可一辈子没有儿子，今后再也不生了！ ”结果生了个女儿。几天后夫妻俩商量着给孩子取名字，妻子说：“我看就叫‘招弟’吧！ ”','2013-10-30 01:56:31','2013-10-30 01:56:31'),(345,'私房钱','有一个人向女友求婚,在答应他的求婚之前, 女子告诉他她在床底下藏了一个鞋盒,并要他答应绝对不能去看盒子里的东西. 男子表示他能够理解,他也不喜欢有人去翻他的皮夹, 也同意绝不会去偷看鞋盒里的东西. 五年过去了,他们一直过着幸福的婚姻生活. 有一天,先生独自在家,他的好奇心战胜了理智, 于是他把鞋盒打开,看到里面放着三个蛋和五千元的现金. 他觉得莫明奇妙. 当男子的妻子回家之后,他向她袒承自己偷看鞋盒的事. 『现在你可以告诉我这些东西代表什么吗?』,他问. 『可以.』,他的妻子回答. 『我每外遇一次,我就会','2013-10-30 01:56:32','2013-10-30 01:56:32'),(346,'第三种可能','护士对产妇说：“您丈夫打来电话，问是生了儿子还是女儿？”“请您问问他，难道还会有第三种可能吗？\"…… ','2013-10-30 01:56:32','2013-10-30 01:56:32'),(347,'还活着','襁褓中睡熟的小宝宝，有时静得出奇，我就赶紧用手去探探是否仍有呼吸，先生因此笑我“神经质”。 夜里睡觉时，先生鼾声大作，我无法入睡，气煞人也！只好拧他一把。“唉哟！ ”只听他笑道：“打鼾有啥不好？让你知道我还活着啊！ ” ','2013-10-30 01:56:33','2013-10-30 01:56:33'),(348,'母兔子=妇产科医生','一职员迟到了,经理不满地问:\"你怎么迟到了!\"职员说:\"我妻子为了生孩子,折腾了一宿!\"经理信了.过了三个星期职员又以同一理由迟到,经理问:\"你妻子是一只母兔子吗?\"职员说:\"她是妇产科医生.\"','2013-10-30 01:56:33','2013-10-30 01:56:33'),(349,'近亲不能结婚','老婆说：嫁给魔鬼也比嫁给你好！！老公说：不行啊，近亲不能结婚啊！！！','2013-10-30 01:56:34','2013-10-30 01:56:34'),(350,'忍不住一定要带套','老公要出差半年， 贤妻收拾行李.完毕，深情地交给老公一包安全套说道：在外面实在忍不住的话记住一定带套，老公听罢激动地说：家里不宽裕还是用她们的吧。','2013-10-30 01:56:34','2013-10-30 01:56:34'),(351,'我们的情妇','一对夫妇正在餐厅用餐，忽然一位妖娆美女走上前来和先生亲热的打招呼，美女离开后，太太问：“那女人是谁？” “如果你非知道不可的话？”丈夫答，“她是我的情妇。” “你的情妇？”太太怒道，“太过份了，我们离婚！ ” “你确定要放弃现有的豪宅、佣人、宾士车、珠宝、貂皮大衣，还有夏威夷豪华大别墅吗？”丈夫问。太太没答腔，两人继续默默吃饭。 过了很久，太太终于用手碰碰丈夫，“那边那个人不是王总吗？”太太问，“他身边那个女人是谁？” “是他的情妇。”丈夫答。 “喔？”太太若无其事地边喝咖啡边说道，“我们的漂亮多了！ ”','2013-10-30 01:56:34','2013-10-30 01:56:34'),(352,'等你脱完我再脱','男：「你先脱, 等你脱完我再脱。」 女：「我脱的比较慢, 还是你先脱好了。」 男：「那这样子吧! 节省时间我们一起脱。」 女：「这怎麽好意思呢？」 男：「没关系啦, 自己人嘛。」 女：「那就快！把全部都塞进来, 小心! 不要把衣服弄脏喔!」 男：「嗯....有这台脱水机, 真是方便多了。」 ','2013-10-30 01:56:35','2013-10-30 01:56:35'),(353,'太小了塞不进去','王老五去年年底娶了老婆，大家都知道王太太手巧，尤其是女红，更是远近驰名。 有一天邻居打从他家经过，听见了王老五夫妻俩在房间的对话。 王老五：「你这个太小了，塞不进去。」 王太太：「你再试试嘛！人家也是挺辛苦的。」 过了一会儿，王老五又说：「不行啊！会痛９ 王太太：「可以啦！我帮你抹点油９ 接着是王老五的喘息声：「哦！哦．．．．」 邻居听得心跳加速、额冒冷汗。他想这对新婚夫妇真是大胆，大白天也干这种事，哪知头才伸出来一点，就被王老五夫妻发现。 两夫妻看见贼头贼脑的邻居，异囗同声地说：「看什麽！没看过人穿鞋啊','2013-10-30 01:56:35','2013-10-30 01:56:35'),(354,'妻子再也不要隆乳了','妻子一直抱怨自己的胸部发育不好，向丈夫要钱去做隆乳手术，丈夫屡次劝说不听，只得想她说：“现在家里钱不够，不能两边同时打针，你先打一边好吗？” 从此，妻子再也不要求隆乳了。','2013-10-30 01:56:36','2013-10-30 01:56:36'),(355,'婚后\"甜蜜\"生活','妻子：“亲爱的，要让我们今后的生活甜甜蜜蜜，以后所有的大事都由你来决定，而所有的小事都听我的安排，怎么样？” 丈夫：“那么，具体讲哪些小事听你的安排呢？” 妻子：“我决定应该申请什么样的工作，应该住在什么样的房子里，应该买什么样的家具，应该到哪里度假，以及诸如此类的事。” 丈夫：“那么哪些大事由我来决定呢？” 妻子：“你决定谁来当首相，我国是否应该增加对贫穷国家的援助，我们对原子弹应该采取什么样的态度，等等。” ','2013-10-30 01:56:40','2013-10-30 01:56:40'),(356,'臀部越来越大了','一天，丈夫对正在吃零食的妻子说：“你的臀部越来越大了。”妻子于是开始节食。几周后妻子的体重减轻了好几磅。这天丈夫又对妻子说：“你不能再减肥了，瞧你脸上已出现皱纹了。”“喂，”妻子不高兴的说，“你最好告诉我，你到底喜欢看我身体的哪一部分？脸还是臀部？” \"我喜欢你的幽默\"丈夫说','2013-10-30 01:56:40','2013-10-30 01:56:40'),(357,'习惯了','某男，刚刚过完新婚之夜。第二天来到班上就一个劲的叹气。他的一个同事过来关心的问他“你怎么了？”某男无奈的回答道“我今天早上一起来就习惯性的顺手给我的妻子100元钱。”他的同事说“那可坏了。”某男又说“更坏的是我的妻子也习惯性的找了我20元钱。”','2013-10-30 01:56:40','2013-10-30 01:56:40'),(358,'头发与胡子','丈夫：真是糟透了！我的头发全是黑的，可是胡子却越来越白，这是怎么回事呀？ 妻子：道理很简单，你的嘴巴用得太多而脑子用得太少。','2013-10-30 01:56:41','2013-10-30 01:56:41'),(359,'不放心','一个女人对邻居说：\"我真不放心丈夫，他扔猫去了，准备到湖中心水最深的地方把猫扔掉。\" 邻居问：\"那有什么放心不下的呢？\"她回答：\"猫已经回家一个钟头了！\"','2013-10-30 01:56:41','2013-10-30 01:56:41'),(360,'土 豆','女士：“警察先生，一年前我丈夫上街去买土豆，从那以后再没回来，你说我该怎么办？” 警察：“嘿，我说你怎么就那么傻？你就别等他的土豆了，改做别的菜吧。”','2013-10-30 01:56:41','2013-10-30 01:56:41'),(361,'迟 了','在地铁里，一位男子发现扒手正在掏他的钱包，便幽默地说:“老兄，你来晚了！我今天虽然领了薪水，但我太太下手比你快多了！ ”','2013-10-30 01:56:42','2013-10-30 01:56:42'),(362,'生命之火','一位鳏夫在他亡妻的墓碑上刻着：“我生命之火已熄灭了。”不久，他又娶了一个妻子，某一个星期六，他带了他的第二个妻子到他第一个妻子的坟墓上。这位新太太看见了墓碑上刻着的字，就用很不高兴的口吻说：“你的生命之火真的已熄灭了？”“是的。”他回答，“但我现在又重新划了一根火柴。”','2013-10-30 01:56:42','2013-10-30 01:56:42'),(363,'订 婚','在一个订婚宴会上，年轻的小姐希望给未婚夫的亲友留下很好的印象。只见她端庄地出来，微笑地招待贵客时，不慎绊在桌子脚上跌了个四脚朝天。他未婚夫急了，想向前扶她，只见她翻身起来说：“先生们，女士们我给你们表演的武术怎么样？”','2013-10-30 01:56:43','2013-10-30 01:56:43'),(364,'吻的次数','一对男女在恋爱，有一天他们第一次亲吻。 男：“告诉我，除了我，还有谁这样吻过你，亲爱的？”女的没有回答。 “你说呀！我不会怪你的。”男的有些不耐烦。 女的笑了笑：“我正在算呢。”','2013-10-30 01:56:43','2013-10-30 01:56:43'),(365,'不需要你指挥','家里实在太小，没有多余的空间给六岁的阿华睡觉，于是他的爸爸妈妈便在床边弄了个小床给阿华。炎热的夏天里，由于夜时气温依旧很高，常常让阿华睡不着，于是就盯着蚊帐上的破洞，没多久，一只蚊子从洞里钻进来，他童心大发，就随着蚊子的动作喊：“进来”、“ 出去”、“进来”、“出去。”正当他玩的很高兴的时候，只听见他父亲从旁边大床上在喊：“浑小子，你爸不需要你指挥。”','2013-10-30 01:56:43','2013-10-30 01:56:43'),(366,'人狗争宠','“我终于从我家那只宠物狗身上，夺回太太的心了！ ” “是喔？！你老婆不是恋狗狂吗？你怎么办到的？” “其实很简单，我只是将我太太精心做给狗吃，狗不愿意吃的食物，而我却津津有味地吃光了。”','2013-10-30 01:56:44','2013-10-30 01:56:44'),(367,'专断的妻子','一个妇女变得十分专断她的丈夫不得不督促她去找心理医生看看玻夫人同意了，于是两个人一同来找医生。丈夫等在外面，过了个把钟头，夫人总算出来了。丈夫问道：\" 在点好转了吧？\"\"没有大变化，\" 夫人说，\" 花了我五十分钟 才使他相信如果他那张病床搁在靠墙的一边，看起来一定会舒服得多……\" ','2013-10-30 01:56:47','2013-10-30 01:56:47'),(368,'聪明男人劝老婆','老婆发现男人带着小秘在饭店吃饭，大闹起来，男人将老婆拉回家，劝她说：“只是玩玩，不会认真。”女人哭说：“玩玩？你为什么不带我去玩玩？”男人说：“我带你去玩，让她到家里来烧饭，你愿意么？”女人说：“那你为什么拉着她的手不松？”男人说：“那是别人的手，不是没拉过新鲜劲么，又不认真。” 女人：“那你为什么拉我的手没那么深情？”男人 ：“我自己拉自己的手，还要什么深情？”女人哭说：“你对我一点感觉也没有了。”男人：“那当然，你已经是我的右手，是我身体的一部分，我虽然不特意去想着她，但我离不开，离开就成残废人了，你','2013-10-30 01:56:48','2013-10-30 01:56:48'),(369,'偷 情','一对夫妻在床上熟睡。大约是半夜时分。好像外面有什么动静，把妻子惊醒了。妻子有点迷迷糊糊，连忙把身边的丈夫推醒。并对丈夫说道：“ 快点起身，好像我丈夫回来了。”丈夫被妻子给推醒了，也是迷迷糊糊的，听到妻子的话后，边起身边说：“你怎么不早说，那我现在该往哪儿躲埃”','2013-10-30 01:56:48','2013-10-30 01:56:48'),(370,'顶针儿','丈夫对妻子说：“亲爱的，我打算送一件生日礼物给你，有了它，你的手指就会显得更加漂亮。”“谢谢，只是别做得太过份了，亲爱的。”“不会的，你看我已经买来了，喏，顶针儿。”','2013-10-30 01:56:49','2013-10-30 01:56:49'),(371,'心理感人','我曾在一家运输公司工作。工作非常紧张，周末几乎是不可能放假的。一次，一位同事请求老板星期六准他一天假：“这是我的结婚纪念日，我还从未有一次纪念日和妻子在一起过过。”老板动了恻隐之心，同意了。老板一走，我问：“你结婚多久了？”“到这星期六正好一年。”','2013-10-30 01:56:49','2013-10-30 01:56:49'),(372,'','','2013-10-30 01:56:49','2013-10-30 01:56:49'),(373,'丈夫和金发美女','太太发现丈夫和金发美女躺在床上亲热，盛怒之下，拿起烟灰缸就想朝他们扔过去。“不要啊！你先听我解释。”丈夫求饶他说：“她不过是个在高速公路上搭便车的女人，我觉得她可怜，才拾回来的。”太太放下烟灰缸，暂且息怒地听他说。“当时，她又饥又渴，所以带回家来喂饱她；后来看见她穿的凉鞋又破又旧，于是把你最少也有一二年不穿的凉鞋送给她了，接着我又发现她的衬衫也破了，我就把一九六九年以来你连瞧都不正眼瞧一下的旧上衣送给她，看到她的牛仔裤，又尽是补钉，所以我就送给她一条你根本不穿的旧长裤，可是，临走前她却问我还有没有你太太不','2013-10-30 01:56:50','2013-10-30 01:56:50'),(374,'不叫可死','两夫妻过年除夕夜时，先生告诉太太说：“以往行房时，每到高潮时你都叫死了，明天是新正初一，大家忌说死字，你 不要说话，记祝”太太答应了，次日行房时太太到了高潮，又如同以往的叫法，先生责怪她犯了忌，太太说：“没关系，像这种死法，那怕死一年也值得。”','2013-10-30 01:56:50','2013-10-30 01:56:50'),(375,'不说谎','夫妻吵架，丈夫一时发狠，骂道：“臭婆娘，明天我做了皇帝，就杀了你！ ” 妻子听了，日夜担忧，哭泣不止。邻家女人来劝解道：“哪能说杀就杀，不要听他一时瞎说。” 妻子道：“我家这个臭乌龟倒是从不说谎的。自己亲生的儿女，前年说要卖，去年当真就卖了。”','2013-10-30 01:56:51','2013-10-30 01:56:51'),(376,'仿 照','有一人在空军服役，他有一个非常漂亮的妻子。每天早上丈夫离开家去飞机场01个小时后，他的妻子就带着一条大白围巾也离开家，到海滨去散步。丈夫驾驶的飞机每天都从这里经过，当她看到的时候，就把白围巾高举起摇晃着，丈夫看见后，便会把飞机的左翼或右翼降低一下，降左翼的意思是说：我今天非常忙，不能回家，降右翼的意思是说：8小时后，我将把你抱在怀里。 有一天，这个人与其他8个飞行员驾驶的8架飞机一同飞行，当他看见妻子后就把右翼降了一下，其余8架飞机不知其故，也都照样将右翼降了一下。','2013-10-30 01:56:51','2013-10-30 01:56:51'),(377,'原配','经理偕其新婚夫人来公司，同职员招呼过后，与一属下进入内室，夫人在门后等候。室内先是一段关于进货出货的对话，在沉默三秒以后，听得属下问：“是原配吗？” 答曰：“不是，原配在罗湖。” 夫人脸色突变，推门而入，连声质问，二人不知所措，属下轻轻举起右手，手上捏着一把钥匙。','2013-10-30 01:56:51','2013-10-30 01:56:51'),(378,'县长的运气','某日，县长携夫人路经一建筑工地，一位戴安全帽的工人冲县长夫人喊道：“你好，还记得我吗？高中的时候我们不是经常约会吗？” 回家后，县长说：“你嫁给我是你的运气，不然你今天就是一个建筑工人的老婆了。” “有运气的是你，否则，今天他就是县长了。”县长夫人回答道。','2013-10-30 01:56:52','2013-10-30 01:56:52'),(379,'懒丈夫的“日记”','昨日太太出差不在家。 没有吃晚饭 今日太太又不在家。 又没有吃晚饭 今日太太还不在家。 还没有吃晚饭。 今日太太还不在家。 探望父母，在父母家吃晚饭。 今日太太还不在家。 探望妹妹，在妹妹家吃晚饭。 今日太太还不在家。 探望老友，老友太太也不在家。 没有吃晚饭。 今日太太还不在家。 打电话问问太太什么时候回家 今日太太要求我不要驼背。 答复太太我想捡钱包。 今日太太又要求我不要驼背。 答复太太我需要表现得谦虚。 今日太太大怒，要求我不要 驼背！ 答复太太那是生活重担造成。 今日太太盛怒，要求我不要驼背 答','2013-10-30 01:56:53','2013-10-30 01:56:53'),(380,'我只出轨三次','一为行政官员看完报纸，愤慨地说：“这么多婚外情事件，什么社会！ ”官夫人接道：“就是嘛，通通该抓去枪毙！ ”大官若有所思地凝视着官夫人，“你老实告诉我，我们结婚这么多年，有没有对我不忠？”“怎么问这样的问题？”官夫人惊问。“不要逃避，回答我的问题！ ”“那，”官夫人显然被下到了，“你先答应我你不会揍我。”“我不打老婆已经很久了。”他感慨地说。“好罢，”官夫人心一横，牙一咬，“只有三次”“三次？！ ”大官急了，“哪三次？”“第一次，记不记得你在芝加哥大学的博士考试，有一个考试委员百般刁难，就是不让你通过？你','2013-10-30 01:56:53','2013-10-30 01:56:53'),(381,'如此吝啬','一对吝啬夫妻。丈夫搜集餐巾，妻子用餐巾做内裤，一日去医院打针，大夫见其内裤左边：欢迎品尝，右边：好再来','2013-10-30 01:56:53','2013-10-30 01:56:53'),(382,'老婆的日记','半夜，醒来，感觉老公紧抱着我，窃喜！心想：这家伙平时挺酷的，没想到睡觉时一不小心就露馅了。于是感动不已，正准备好好享受他的拥抱时，听见他迷迷糊糊说到 ：“老婆！好冷！ ”当时恨不得把他踢下床去。 某日和老公一起看电视，电视中女演员正跳芭蕾，老公对我说：“老婆，你也很适合跳芭蕾。”窃喜！心想：老公一定觉得我身材不错。可是我想让他表扬的直接点，于 是沉住气继续问他：“你为什么说我适合跳芭蕾呀？”老公一本正经并用很专业的语气 说到：“跳芭蕾的人胸都不能太大的。”我顿时没从椅子上滚下来。 一周末起床后，和老公说到','2013-10-30 01:56:54','2013-10-30 01:56:54'),(383,'到底谁在是上','夫妻吵架，妻能言善辩，夫责怪妻子说：“我是天，你是地，天在地上，岂可欺天。” 妻道：“我是阴，你是阳，阴在阳上，岂可落后。” 夫道：“以乾坤而论，是乾在上。” 妻曰：“以雌雄而论是雌在上。” 夫曰：“以夫妻而论，是夫在上。” 妻道：“以牝牡而论是牝在上。”丈夫气不过，大声说：“我们行房时，到底谁在上？”妻子答：“有时高兴，玩个倒浇蜡烛还是我在上面。”','2013-10-30 01:56:55','2013-10-30 01:56:55'),(384,'孩子是谁的','有一对夫妇要离婚，可是他们有一个孩子，两个人都想要。所以就告到法院去了。太太说：“孩子是我生的，我生孩子的时候你在旁边。所以孩子应该是我的。”法官想想就说：“嗯！你对，孩子是你的。”丈夫想想这样不对结果他突然想道就说：“不对不对！请问法官大人！你有没有看过自动贩卖机！ ”法官说：“怎样！ ”丈夫说：“你投钱进去掉出来的饮料是你的，所以孩子是我的。”法官想想就说：“嗯！你对！孩子是你的。”','2013-10-30 01:56:56','2013-10-30 01:56:56'),(385,'聪明的男人怎么骗女人','老婆发现男人带着小秘在饭店吃饭，大闹起来，男人将老婆拉回家，劝她说：“只是玩玩，不会认真。”女人哭说：“玩玩？你为什么不带我去玩玩？”男人说：“我带你去玩，让她到家里来烧饭，你愿意么？”女人说：“那你为什么拉着她的手不松？”男人说：“那是别人的手，不是没拉过新鲜劲么，又不认真。” 女人：“那你为什么拉我的手没那么深情？”男人 ：“我自己拉自己的手，还要什么深情？”女人哭说：“你对我一点感觉也没有了。”男人：“那当然，你已经是我的右手，是我身体的一部分，我虽然不特意去想着她，但我离不开，离开就成残废人了，你','2013-10-30 01:56:57','2013-10-30 01:56:57'),(386,'新婚四夜睡姿','“新婚夫妻头四天夜里睡妄像四个字，”老黄在临下班之前大发高论，“第一夜像‘非’字，所谓羞羞答答，所以背向而卧；第二夜像‘羽’字，新郎毕竟脸皮较厚：第三夜像臼’字，新娘已不像头两夜那么害羞了，因而已有相就之意；第四夜像‘日’字，左右上下密不通风，足证明情好缠绵了。”','2013-10-30 01:56:57','2013-10-30 01:56:57'),(387,'爱的真谛','丈夫：“为什么上帝把女人造得美丽而又愚蠢呢？”妻子：“道理非常简单。把我们造得美丽，你们才会爱我们；把我们造得愚蠢，我们才会爱你们。”','2013-10-30 01:56:58','2013-10-30 01:56:58'),(388,'迷糊老婆爆笑语录','其实有这样的老婆，每天笑一笑也不错喔 ........ ^_^ ※有一天下班後，我打她的手机，想叫她带一点菜回来，她一直不接电话． 过了十几分钟，她上气不接下气地跑回家， 很得意地对我说：「为了节约电话费，所以我不接电话９ 我差点昏倒， 接电话也要钱ㄇ??? @)_(@ （估计他们那里电话是单向收费）※有一次我和她出门，两个人只带了一把钥匙． 她要去菜市场，叫我先回家，把钥匙留给她． 我问她：「为什麽把钥匙留给你呢？」 她说：「这样等一下我回家你就不用出来给我开门啦９ 那谁帮你老公开门??? @)_(@ ','2013-10-30 01:56:58','2013-10-30 01:56:58'),(389,'不能戒色','有一人纵情酒色，卧病在床，医生诊断以后，对他说；“这是所谓‘酒色过度，正如双斧伐枯树’，今后宜切戒之。”他的妻子在旁边白了医生一眼，医生顿时感到不安，因而转口说道：“即不能戒色，也须戒酒。”病人辩道：“色害甚于酒，宜先戒之才是。”其妻顿脚道：“看你这脾气！医生的话不听，你这病怎么得好 。”','2013-10-30 01:56:59','2013-10-30 01:56:59'),(390,'体贴的妻子','“亲爱的，”妻子对丈夫说，“我买了一块丝料，准备给你做条领带。”“你真好！不过干吗要买这么多呀？”“剩下的那部分我想给自己做条连衣裙！ ”','2013-10-30 01:56:59','2013-10-30 01:56:59'),(391,'怎能随便脱','男士A：“我女友离开了我，我不想活了。”男士B安慰道：“女人如衣服，想脱就脱，有什么大不了的？”正好男士B的妻子听到了，怒道：“什么？你给我再说一次。”男士B赶忙陪笑，“我的好太太，我是说女人是裤子，怎么能随便脱呢？”','2013-10-30 01:56:59','2013-10-30 01:56:59'),(392,'别人的大方','当我结婚的时候，我向我的妻子说：“达令，每吻你一次，我就给你一块钱。”我们结婚以后，我每吻她一次仍给她一块钱，她就把这些钱放进木箱。有一次我带着妻子的照片去旅行。于是当我每吻她的照片的时候，我就寄给她一块钱。我回家后，问我的妻子：“达令，你把箱子打开让我看看，里边有多少钱了。”我把木箱打开的时候，发现里面有百元的，五元以及十元的钞票，和一些帽子，衣服，鞋子等，于是我问她：“达令，这是什么？我每次只给你一元钱啊！ ”她说：“是的，但是别人并不像你那样吝啬啊！ ”','2013-10-30 01:57:00','2013-10-30 01:57:00'),(393,'两万与一个','夫妻俩在谈论《三国演义》。妻子说：“曹操率领81万人马下江南……”丈夫听了，立刻纠正说：“不对，人家是83万人马。” 妻子说：“是81万。” 丈夫说：“是83万。” 两人争执不下，干脆去取书。丈夫上炕取书时，把被窝里睡得正香的孩子踩了一脚，孩子哭起来，妻子说：“该死的，把娃也踩死了！ ” 丈夫听了，不耐烦地说：“两万人都叫你给说没了，还在乎这一个半个的。”','2013-10-30 01:57:00','2013-10-30 01:57:00'),(394,'只剩20次机会了','阿三风流成性，终于有一天那玩意不灵了。医生检查后告诉说：“由于过度透支，你得了严重的阳痿。阿三忙问：“能治吗？”医生回答说：“我这有种药能治你的玻但是你今后只能过20次性生活了。” 阿三治疗完回到家中，将他的不幸告诉了媳妇。媳妇正值虎狼之年，一听急得嚎啕大哭。她泪水涟涟地问：老公啊，今后这20次可怎么安排呢？” 谁知阿三回答道：“这个你不用操心，刚才回来的路上我挨个数过，剩下的20次还轮不到你呢。” ','2013-10-30 01:57:01','2013-10-30 01:57:01'),(395,'摸过的人都这么说','有个丈夫跟太太亲热，抚摸着太太，很有情趣低地赞美着：“你的皮肤摸起来真细，绝不像四十岁的女人。” 太太笑：“是啊！最近摸过的人都这么说。” 啪！！丈夫吼着：“你最近让多少人摸过？老实招来！ ” 太太呜着脸，哭着喊：“大家都这么说啊！每个护肤中心的小姐都这么说的啊！ ”','2013-10-30 01:57:01','2013-10-30 01:57:01'),(396,'依你这种身材','暑假到了，黄教授带着黄太太一起去深圳玩。到了晚上对黄教授夫妇投宿旅馆时，黄太太想要洗个澡，但却又担心的对老黄说：“看到报上的报导，某些旅馆或饭店都会藏有隐藏式的录影机，万一我真的被拍到了，那该怎么办呢？” 黄教授一脸不屑头也不回的说：“放心吧！依你这种身材，即使被不幸地拍到了，他们也一定会全剪掉的！怕什么吗？” ','2013-10-30 01:57:01','2013-10-30 01:57:01'),(397,'自主权','年末，丈夫存了一年私房钱被妻子发现，妻子火起，一拳打在丈夫的金丝眼镜上。丈夫捂着脸，委屈地说：“都什么年代了，现在搞市场经济，开放搞活了，你还用计划经济那一套管我，让我没有一点自主权。” “自主‘拳’在老娘这里！再搞活，也得打击经济犯罪！ ” ','2013-10-30 01:57:02','2013-10-30 01:57:02'),(398,'泡菜送到 [爆笑]','有一个将要服兵役的士兵，害怕自己出去后太太生了孩子别人会说闲话，于是临出行之前对怀孕的太太说：“亲爱的，如果你生了，就发电报给我，说‘泡菜已送到’，可别说你生了孩子。” 几个月后，这位士兵收到了太太的电报：“泡菜送到两盘，其中一盘还添加香肠。”','2013-10-30 01:57:02','2013-10-30 01:57:02'),(399,'对待外遇[爆笑]','妻子和丈夫鱼欢之后，开始讨论外遇的问题，丈夫突然问妻子道：“假如有一天我不幸有了外遇，亲爱的，你会怎么处理呢？”“我绝不会饶恕你的！ ”妻子坚决地回答。接着他反问丈夫：“假如我有外遇的话，你会怎样对待呢？”丈夫沉思了一下说：“这是人性的弱点，我想我会原谅你的，不计较一切！ ”他才说完就听到妻字兴奋地对床下叫道：“出来吧！他不会计较的。”','2013-10-30 01:57:02','2013-10-30 01:57:02'),(400,'在劫难逃 [爆笑]','邵某很迷信，整天搞占卜之术。有一天，他占算出家传的一只古碗将要于某日中午被摔碎，他心想，这是天意，绝难避免。 为了亲眼看看碗是怎样被摔破的，便用绳子把古碗缚好，高高吊在屋梁上，到了预定那天，他目不转睛地盯着古碗。 这时，他的老婆早已烧好了饭，屡次让孩子叫他吃饭，他说什么也不愿离开。他老婆大怒，忙去看个究竟，一见他那个呆相，越发生气。她一声不响地抄起了一根木棍，对准了古碗打去，碗被敲得粉碎。邵某却不生气，只是哺哺自语：“晤，原来是这样的，真是天数已定，在劫难逃啊！ ”','2013-10-30 01:57:02','2013-10-30 01:57:02'),(401,'妻子的担心','一个推销员的妻子哭着说：“每次你外出时，我都很担心。”丈夫安慰她说：“亲爱的，别替我担心，我随时都会赶回来的。”妻子道：“我知道，那正是我担心的原因。”','2013-10-30 01:57:03','2013-10-30 01:57:03'),(402,'真是感人','彼得把一束白色的马蹄莲放在母亲的墓前，静静地祈祷了一会儿，准备离去，这时突然听见悲伤的哭泣声。听这哭声，感情应该很深吧，真是感人！彼得被深深打动，敬佩之情油然而生，于是决定去看看。顺着哭声走近，发现一名男子跪在一块墓碑前，低头痛哭：“你为什么要走？呜—— 你为什么要走？呜——呜——留下我孤孤单单一个人。。。”彼得决定上去劝劝：“仁兄，虽然我不愿打扰您，但这样哭会哭坏身体的，节哀吧！扫墓的人我见过很多，向您这样情深意重的，我还是头一次遇见。不知是否可以冒昧地问一句，这里长眠的是您的什么亲人？”“我妻子的前夫','2013-10-30 01:57:03','2013-10-30 01:57:03'),(403,'没有关系','周未，丈夫从托儿所把孩子领回家。妻子说：“亲爱的，这不是我们的孩子呀？”丈夫仔细一看，说：“这的确不是。不过没关系，反正星期一我们还得把孩子送回去。”','2013-10-30 01:57:05','2013-10-30 01:57:05'),(404,'可爱的妻子','丈夫要到外地出差，临走时对妻子说：“在我离家期间把收到的给我的信寄给我。”妻子说：“放心吧！ ” 一个月过去了，他一封信也没收到。他感到很奇怪，于是打电话问妻子：“为什么不把我的信寄给我？” “你把信箱上的钥匙带走了。” 丈夫道了歉，并说马上把钥匙寄回去。 又过了一个月，还是没有收到一封信，他很生气。出差完回到家，他问妻子是怎么一回事儿。 “我有什么办法呢！亲爱的，你寄回来的钥匙也锁在信箱里了。”','2013-10-30 01:57:05','2013-10-30 01:57:05');
