INSERT INTO `moods` VALUES (1,'新站初始化','之前数据库资料全部丢失，现在初始化中。',NULL,NULL,'2013-10-20 19:12:56','2013-10-20 19:12:56'),(3,'体谅','茫茫人海如果可以找到一个自己心仪的，互相真爱的人，真不容易，也是多么大的荣幸。也是事事不是你想的那样，没有如此完美。或许没有你想象中的那么好，应该也不会糟糕到哪里去。生活本来没有那么美好，所以幸福都要知福惜福好好珍惜。多说关怀话，少说责备话，人与人之间需要互相体谅。爱人之间更应该如此。',NULL,NULL,'2013-10-28 03:52:05','2013-10-28 03:52:05'),(4,'高处','人真的要往高处走吗？',NULL,NULL,'2013-10-28 03:55:11','2013-10-28 03:55:11'),(5,'心','很对不起自己的心，让他疼了一次又一次。',NULL,NULL,'2013-10-28 04:00:17','2013-10-28 04:00:17'),(6,'文武','文能提笔控萝莉，武能床上定人妻，进可欺身压正太，退能提臀迎众基。',NULL,NULL,'2013-10-28 04:02:59','2013-10-28 04:02:59'),(7,'最牛逼的做爱','寒冬，操场，扶法桐而推车，气寒然双双而瑟瑟，突发力，拔之怒射，凝视，子孙成冰。',NULL,NULL,'2013-10-28 04:04:13','2013-10-28 04:04:13'),(8,'时间','额，不知不觉已经30号了，这块，认识现在的女朋友，5个多月了，搬进新家，五个多月了，换了新公司，也五个多月了。开始的激动到现在的平淡，果然，时间能够冲淡一切美好的心情。淡过人生吧，孩子。',NULL,NULL,'2013-10-30 02:00:50','2013-10-30 02:00:50');
/*!40000 ALTER TABLE `moods` ENABLE KEYS */;
